INSERT INTO `sig_docs` (`id`, `nombre_docs`, `contenido_docs`, `created_at`) VALUES
(1, 'Administración Servidor Linux', '<div><pre><code>        &lt;span class=\"label u-mobile-hide\" data-js=\"product-section-label\"&gt;Curso&lt;/span&gt;\n\n        &lt;p&gt;\n            Con el objetivo de mejorar los procesos de administración dados en la empresa, se ha realizado un curso\n            en Platzi, donde se presentan a continuación algunas notas importantes a tener en cuenta.\n        &lt;/p&gt;\n\n        &lt;h3&gt;Principales distribuciones&lt;/h3&gt;\n        + Ubuntu Server\n        &lt;br&gt;\n        + Centos Server: viene de la familia Red Hat.\n\n        &lt;h3&gt;Importancia de soporte extendido LTS&lt;/h3&gt;\n        + Actualizaciones de Software por 5 años\n        &lt;br&gt;\n        + Soporte no extendido por 9 meses\n\n        &lt;h2 id=\"1-comandos\" class=\"dx-anchor\"&gt;&lt;a class=\"dx-anchor__icon\" href=\"#1-comandos\" aria-hidden=\"true\"&gt;&lt;/a&gt;Comandos\n            linux&lt;/h2&gt;\n\n        &lt;h3&gt;Cuando listamos con ls -l obtenemos un primer caracter que es:&lt;/h3&gt;\n        1. - para archivo\n        &lt;br&gt;\n        2. d para directorio\n        &lt;br&gt;\n        3. l para enlace simbólico\n\n        &lt;pre class=\"dx-pre-hljs\" id=\"c2cb-target-0\"&gt;&lt;code class=\"hljs ruby\"&gt;vagrant@homestead&lt;span\n                class=\"hljs-symbol\"&gt;:~&lt;/span&gt;$ ls -lh\n\n</code></pre><p>total <span class=\"hljs-number\">4.1</span>G<br>-rw-r--r--    <span class=\"hljs-number\">1</span> root root    <span class=\"hljs-number\">0</span> Nov <span class=\"hljs-number\">22</span>  <span class=\"hljs-number\">2018</span> aquota.group<br>-rw-r--r--    <span class=\"hljs-number\">1</span> root root    <span class=\"hljs-number\">0</span> Nov <span class=\"hljs-number\">22</span>  <span class=\"hljs-number\">2018</span> aquota.user<br>drwx--x--x    <span class=\"hljs-number\">3</span> root root <span class=\"hljs-number\">4.0</span>K Sep <span class=\"hljs-number\">24</span> <span class=\"hljs-number\">20</span><span class=\"hljs-symbol\">:</span><span class=\"hljs-number\">45</span> backup<br>dr-xr-xr-x.   <span class=\"hljs-number\">2</span> root root <span class=\"hljs-number\">4.0</span>K Jul <span class=\"hljs-number\">17</span>  <span class=\"hljs-number\">2019</span> bin<br>dr-xr-xr-x.   <span class=\"hljs-number\">4</span> root root <span class=\"hljs-number\">4.0</span>K Feb  <span class=\"hljs-number\">4</span> <span class=\"hljs-number\">12</span><span class=\"hljs-symbol\">:</span>09 boot<br>drwxr-xr-x    <span class=\"hljs-number\">2</span> root root <span class=\"hljs-number\">4.0</span>K Oct  <span class=\"hljs-number\">9</span>  <span class=\"hljs-number\">2018</span> cgroup<br>drwxr-xr-x   <span class=\"hljs-number\">19</span> root root <span class=\"hljs-number\">3.4</span>K Feb  <span class=\"hljs-number\">4</span> <span class=\"hljs-number\">12</span><span class=\"hljs-symbol\">:</span><span class=\"hljs-number\">12</span> dev<br>-rw-r--r--    <span class=\"hljs-number\">1</span> root root <span class=\"hljs-number\">6.7</span>K Nov <span class=\"hljs-number\">22</span>  <span class=\"hljs-number\">2018</span> error_log</p><div class=\"dx-pre-meta\"><button class=\"dx-btn dx-btn-copy\" data-c2cb-target=\"c2cb-target-0\" data-dxa=\"sampleCode,copyToClipboard,/documentation/bancolombia/comandos-linux.html|c2cb-target-0\">copy</button></div><p></p>\n<pre><code>        &lt;h3&gt;Cuando listamos con &lt;strong&gt;ls -ltr&lt;/strong&gt; podemos ver archivos en orden de fecha de modificación\n            reciente.&lt;/h3&gt;\n\n        &lt;h3&gt;/lib/systemd/system --&amp;gt; podemos ver todos los servicios que tiene el sistema operativo cuando\n            arranca.&lt;/h3&gt;\n\n        &lt;h3&gt;tty --&amp;gt; podemos ver en la terminal o consola en la que estamos&lt;/h3&gt;\n\n        &lt;pre class=\"dx-pre-hljs\" id=\"c2cb-target-1\"&gt;&lt;code class=\"hljs ruby\"&gt;vagrant@homestead&lt;span\n                class=\"hljs-symbol\"&gt;:~&lt;/span&gt;$ tty\n\n</code></pre><p>/dev/pts/<span class=\"hljs-number\">1</span></p><div class=\"dx-pre-meta\"><button class=\"dx-btn dx-btn-copy\" data-c2cb-target=\"c2cb-target-1\" data-dxa=\"sampleCode,copyToClipboard,/documentation/bancolombia/comandos-linux.html|c2cb-target-1\">copy</button></div><p></p>\n<pre><code>        &lt;h3&gt;chvt {number} --&amp;gt; podemos cambiar entre terminales virtuales colocando el numero en {number}, por\n            defecto es tty1&lt;/h3&gt;\n\n        &lt;pre class=\"dx-pre-hljs\" id=\"c2cb-target-2\"&gt;&lt;code class=\"hljs ruby\"&gt;vagrant@homestead&lt;span\n                class=\"hljs-symbol\"&gt;:~&lt;/span&gt;$ chvt &lt;span\n                class=\"hljs-number\"&gt;3&lt;/span&gt;&lt;/code&gt;&lt;div class=\"dx-pre-meta\"&gt;&lt;button class=\"dx-btn dx-btn-copy\"\n                                                                                    data-c2cb-target=\"c2cb-target-2\"\n                                                                                    data-dxa=\"sampleCode,copyToClipboard,/documentation/bancolombia/comandos-linux.html|c2cb-target-2\"&gt;copy&lt;/button&gt;&lt;/div&gt;&lt;/pre&gt;\n\n        &lt;h3&gt;Validar MX&lt;/h3&gt;\n\n        &lt;pre class=\"dx-pre-hljs\" id=\"c2cb-target-3\"&gt;&lt;code class=\"hljs ruby\"&gt;vagrant@homestead&lt;span\n                class=\"hljs-symbol\"&gt;:~&lt;/span&gt;$ dig google.com MX&lt;/code&gt;&lt;div\n                class=\"dx-pre-meta\"&gt;&lt;button class=\"dx-btn dx-btn-copy\" data-c2cb-target=\"c2cb-target-3\"\n                                            data-dxa=\"sampleCode,copyToClipboard,/documentation/bancolombia/comandos-linux.html|c2cb-target-3\"&gt;copy&lt;/button&gt;&lt;/div&gt;&lt;/pre&gt;\n\n        &lt;h3&gt;Validar Servicio&lt;/h3&gt;\n\n        &lt;pre class=\"dx-pre-hljs\" id=\"c2cb-target-4\"&gt;&lt;code class=\"hljs ruby\"&gt;vagrant@homestead&lt;span\n                class=\"hljs-symbol\"&gt;:~&lt;/span&gt;$ ps faux &lt;span\n                class=\"hljs-params\"&gt;| grep sendmail&lt;/span&gt;&lt;/code&gt;&lt;div class=\"dx-pre-meta\"&gt;&lt;button\n                class=\"dx-btn dx-btn-copy\"\n                data-c2cb-target=\"c2cb-target-4\"\n                data-dxa=\"sampleCode,copyToClipboard,/documentation/bancolombia/comandos-linux.html|c2cb-target-4\"&gt;copy&lt;/button&gt;&lt;/div&gt;&lt;/pre&gt;\n\n        &lt;h3&gt;Validar nombre completo de dominio - servidor&lt;/h3&gt;\n\n        &lt;pre class=\"dx-pre-hljs\" id=\"c2cb-target-5\"&gt;&lt;code class=\"hljs ruby\"&gt;vagrant@homestead&lt;span\n                class=\"hljs-symbol\"&gt;:~&lt;/span&gt;$ hostname --fqdn&lt;/code&gt;&lt;div\n                class=\"dx-pre-meta\"&gt;&lt;button class=\"dx-btn dx-btn-copy\" data-c2cb-target=\"c2cb-target-5\"\n                                            data-dxa=\"sampleCode,copyToClipboard,/documentation/bancolombia/comandos-linux.html|c2cb-target-5\"&gt;copy&lt;/button&gt;&lt;/div&gt;&lt;/pre&gt;\n\n        &lt;h3&gt;Validar dirección IP de servidor&lt;/h3&gt;\n\n        &lt;pre class=\"dx-pre-hljs\" id=\"c2cb-target-6\"&gt;&lt;code class=\"hljs ruby\"&gt;vagrant@homestead&lt;span\n                class=\"hljs-symbol\"&gt;:~&lt;/span&gt;$ hostname -i&lt;/code&gt;&lt;div\n                class=\"dx-pre-meta\"&gt;&lt;button class=\"dx-btn dx-btn-copy\" data-c2cb-target=\"c2cb-target-6\"\n                                            data-dxa=\"sampleCode,copyToClipboard,/documentation/bancolombia/comandos-linux.html|c2cb-target-6\"&gt;copy&lt;/button&gt;&lt;/div&gt;&lt;/pre&gt;\n\n        &lt;h3&gt;Validar respuesta exim&lt;/h3&gt;\n\n        &lt;pre class=\"dx-pre-hljs\" id=\"c2cb-target-7\"&gt;&lt;code class=\"hljs ruby\"&gt;vagrant@homestead&lt;span\n                class=\"hljs-symbol\"&gt;:~&lt;/span&gt;$ exim4 -d -bvs noreply@example.com&lt;/code&gt;&lt;div\n                class=\"dx-pre-meta\"&gt;&lt;button class=\"dx-btn dx-btn-copy\" data-c2cb-target=\"c2cb-target-7\"\n                                            data-dxa=\"sampleCode,copyToClipboard,/documentation/bancolombia/comandos-linux.html|c2cb-target-7\"&gt;copy&lt;/button&gt;&lt;/div&gt;&lt;/pre&gt;\n\n        &lt;blockquote class=\"dx-blockquote-note\"&gt;\n            &lt;strong&gt;Nota: &lt;/strong&gt; para obtener información adicional de un comando a ejecutar, lo hacemos con man\n            &lt;pre class=\"dx-pre-hljs\" id=\"c2cb-target-8\"&gt;&lt;code class=\"hljs ruby\"&gt;vagrant@homestead&lt;span\n                    class=\"hljs-symbol\"&gt;:~&lt;/span&gt;$ man {command}&lt;/code&gt;&lt;div class=\"dx-pre-meta\"&gt;&lt;button\n                    class=\"dx-btn dx-btn-copy\" data-c2cb-target=\"c2cb-target-8\"\n                    data-dxa=\"sampleCode,copyToClipboard,/documentation/bancolombia/comandos-linux.html|c2cb-target-8\"&gt;copy&lt;/button&gt;&lt;/div&gt;&lt;/pre&gt;\n            Ejemplo\n            &lt;pre class=\"dx-pre-hljs\" id=\"c2cb-target-9\"&gt;&lt;code class=\"hljs ruby\"&gt;vagrant@homestead&lt;span\n                    class=\"hljs-symbol\"&gt;:~&lt;/span&gt;$ man apache2&lt;/code&gt;&lt;div class=\"dx-pre-meta\"&gt;&lt;button\n                    class=\"dx-btn dx-btn-copy\"\n                    data-c2cb-target=\"c2cb-target-9\"\n                    data-dxa=\"sampleCode,copyToClipboard,/documentation/bancolombia/comandos-linux.html|c2cb-target-9\"&gt;copy&lt;/button&gt;&lt;/div&gt;&lt;/pre&gt;\n        &lt;/blockquote&gt;\n\n        &lt;blockquote class=\"dx-blockquote-note\"&gt;\n            &lt;strong&gt;Nota: &lt;/strong&gt; Otro comando de gran utilidad es history, el cual nos permite visualizar todos\n            los comandos ingresados recientemente.\n            &lt;pre class=\"dx-pre-hljs\" id=\"c2cb-target-10\"&gt;&lt;code class=\"hljs ruby\"&gt;vagrant@homestead&lt;span\n                    class=\"hljs-symbol\"&gt;:~&lt;/span&gt;$ history&lt;/code&gt;&lt;div class=\"dx-pre-meta\"&gt;&lt;button\n                    class=\"dx-btn dx-btn-copy\"\n                    data-c2cb-target=\"c2cb-target-10\"\n                    data-dxa=\"sampleCode,copyToClipboard,/documentation/bancolombia/comandos-linux.html|c2cb-target-10\"&gt;copy&lt;/button&gt;&lt;/div&gt;&lt;/pre&gt;\n        &lt;/blockquote&gt;\n\n        &lt;blockquote class=\"dx-blockquote-note\"&gt;\n            &lt;strong&gt;Nota: &lt;/strong&gt;para realizar una búsqueda recursiva utilizamos el siguiente comando:\n            &lt;pre class=\"dx-pre-hljs\" id=\"c2cb-target-11\"&gt;&lt;code class=\"hljs ruby\"&gt;vagrant@homestead&lt;span\n                    class=\"hljs-symbol\"&gt;:~&lt;/span&gt;$ grep -ri &lt;span\n                    class=\"hljs-string\"&gt;\"frase o palabra a buscar\"&lt;/span&gt; *&lt;/code&gt;&lt;div\n                    class=\"dx-pre-meta\"&gt;&lt;button class=\"dx-btn dx-btn-copy\" data-c2cb-target=\"c2cb-target-11\"\n                                                data-dxa=\"sampleCode,copyToClipboard,/documentation/bancolombia/comandos-linux.html|c2cb-target-11\"&gt;copy&lt;/button&gt;&lt;/div&gt;&lt;/pre&gt;\n            Si la búsqueda la queremos realizar en un directorio específico:\n            &lt;pre class=\"dx-pre-hljs\" id=\"c2cb-target-12\"&gt;&lt;code class=\"hljs ruby\"&gt;vagrant@homestead&lt;span\n                    class=\"hljs-symbol\"&gt;:~&lt;/span&gt;$ grep -ri &lt;span\n                    class=\"hljs-string\"&gt;\"frase o palabra a buscar\"&lt;/span&gt; /{dir_name}&lt;/code&gt;&lt;div\n                    class=\"dx-pre-meta\"&gt;&lt;button class=\"dx-btn dx-btn-copy\" data-c2cb-target=\"c2cb-target-12\"\n                                                data-dxa=\"sampleCode,copyToClipboard,/documentation/bancolombia/comandos-linux.html|c2cb-target-12\"&gt;copy&lt;/button&gt;&lt;/div&gt;&lt;/pre&gt;\n        &lt;/blockquote&gt;\n\n        &lt;blockquote class=\"dx-blockquote-note\"&gt;\n            El sistema operativo cuenta con 6 consolas - terminales y una 7 para interfaz gráfica.\n        &lt;/blockquote&gt;\n\n        &lt;h3&gt;w --&amp;gt; lista las conexiones existentes en las diferentes terminales virtuales ademas de dar\n            información\n            de recursos usados&lt;/h3&gt;\n        &lt;h3&gt;who --&amp;gt; es una variante de w, pero con menos datos, no disponible por defecto para Centos.&lt;/h3&gt;\n        &lt;h3&gt;ps --&amp;gt; lista los procesos activos, si se usa la opcion ps -ft tty1 visualiza los procesos en la\n            terminal\n            1&lt;/h3&gt;\n        &lt;h3&gt;kill “PID” --&amp;gt; mata el Id de proceso seleccionado&lt;/h3&gt;\n\n        &lt;pre class=\"dx-pre-hljs\" id=\"c2cb-target-13\"&gt;&lt;code class=\"hljs ruby\"&gt;vagrant@homestead&lt;span\n                class=\"hljs-symbol\"&gt;:~&lt;/span&gt;$ w\n\n</code></pre><p> <span class=\"hljs-number\">16</span><span class=\"hljs-symbol\">:</span>09<span class=\"hljs-symbol\">:</span><span class=\"hljs-number\">18</span> up <span class=\"hljs-number\">31</span> days,  <span class=\"hljs-number\">4</span><span class=\"hljs-symbol\">:</span><span class=\"hljs-number\">01</span>,  <span class=\"hljs-number\">0</span> users,  load <span class=\"hljs-symbol\">average:</span> <span class=\"hljs-number\">0</span>.<span class=\"hljs-number\">07</span>, <span class=\"hljs-number\">0</span>.<span class=\"hljs-number\">03</span>, <span class=\"hljs-number\">0</span>.<span class=\"hljs-number\">00</span><br>USER     TTY      FROM              LOGIN@   IDLE   JCPU   PCPU WHAT<br>vagrant@homestead<span class=\"hljs-symbol\">:~</span>$ who<br>vagrant@homestead<span class=\"hljs-symbol\">:~</span>$ ps<br>  PID TTY          TIME CMD<br><span class=\"hljs-number\">18839</span> pts/<span class=\"hljs-number\">1</span>    <span class=\"hljs-number\">00</span><span class=\"hljs-symbol\">:</span><span class=\"hljs-number\">00</span><span class=\"hljs-symbol\">:</span><span class=\"hljs-number\">00</span> bash<br><span class=\"hljs-number\">21509</span> pts/<span class=\"hljs-number\">1</span>    <span class=\"hljs-number\">00</span><span class=\"hljs-symbol\">:</span><span class=\"hljs-number\">00</span><span class=\"hljs-symbol\">:</span><span class=\"hljs-number\">00</span> ps<br>vagrant@homestead<span class=\"hljs-symbol\">:~</span>$</p><div class=\"dx-pre-meta\"><button class=\"dx-btn dx-btn-copy\" data-c2cb-target=\"c2cb-target-13\" data-dxa=\"sampleCode,copyToClipboard,/documentation/bancolombia/comandos-linux.html|c2cb-target-13\">copy</button></div><br>            <code><br>            </code><p></p>\n<pre><code>        &lt;h3&gt;Permisos de archivos&lt;/h3&gt;\n        Se define por 9 caracteres en orden de permisos de usuario, ejemplo: rw-rw-r--\n        &lt;br&gt;\n        r: Permisos de lectura\n        &lt;br&gt;\n        w: Permisos de escritura\n        &lt;br&gt;\n        x: Permiso de ejecución\n        &lt;br&gt;\n        -: Permiso no asignado\n        &lt;br&gt;\n        + Los 3 primeros son para el usuario\n        &lt;br&gt;\n        + Los 3 siguientes para el grupo\n        &lt;br&gt;\n        + Los últimos 3 son generales para otros usuarios en el sistema operativo.\n\n        &lt;h2 id=\"2-comandos-adicionales\" class=\"dx-anchor\"&gt;&lt;a class=\"dx-anchor__icon\" href=\"#2-comandos-adicionales\"\n                                                             aria-hidden=\"true\"&gt;&lt;/a&gt;Comandos adicionales&lt;/h2&gt;\n        &lt;code style=\"background: #73ccf5;\"&gt;ps aux&lt;/code&gt; --&amp;gt; procesos corriendo en el SO\n        &lt;br&gt;\n        &lt;code style=\"background: #73ccf5;\"&gt;ps aux | grep root &lt;/code&gt;--&amp;gt; filtrar por root\n        &lt;br&gt;\n        &lt;code style=\"background: #73ccf5;\"&gt;jobs &lt;/code&gt; --&amp;gt; procesos que se estan ejecutando\n        &lt;br&gt;\n        &lt;code style=\"background: #73ccf5;\"&gt;fg &lt;/code&gt; --&amp;gt; traer el proceso suspendido\n        &lt;br&gt;\n        &lt;code style=\"background: #73ccf5;\"&gt;./script.sh &lt;/code&gt;--&amp;gt; ejecutar script\n        &lt;br&gt;\n        &lt;code style=\"background: #73ccf5;\"&gt;./script.sh &amp;amp; &lt;/code&gt;--&amp;gt; ejecutar script y genera proceso\n        especifico para\n        el script\n        &lt;br&gt;\n        &lt;code style=\"background: #73ccf5;\"&gt;nohup ./script.sh &lt;/code&gt;--&amp;gt; genera una salida del resultado del\n        script\n        &lt;br&gt;\n        &lt;code style=\"background: #73ccf5;\"&gt;cat /proc/cpuinfo | grep -i \"Processor\" &lt;/code&gt; --&amp;gt; ver el número de\n        procesadores.\n        &lt;br&gt;\n        &lt;code style=\"background: #73ccf5;\"&gt;free &lt;/code&gt;--&amp;gt; memoria RAM\n        &lt;br&gt;\n        &lt;code style=\"background: #73ccf5;\"&gt;free -h &lt;/code&gt;--&amp;gt; memoria en un mejor formato\n        &lt;br&gt;\n        Ver memoria disponible en disco:\n        &lt;pre&gt;&lt;code&gt;$ df -h&lt;/code&gt;&lt;/pre&gt;\n        &lt;code style=\"background: #73ccf5;\"&gt;sudo ps auxf | sort -nr -k 3 | head -5 &lt;/code&gt;--&amp;gt; revisar los 5\n        proceso\n        que consumem mas cpu\n        &lt;br&gt;\n        &lt;code style=\"background: #73ccf5;\"&gt;sudo ps auxf | sort -nr -k 4 | head -5 &lt;/code&gt; --&amp;gt; revisar los 5\n        proceso\n        que consumem mas RAM\n        &lt;br&gt;\n        &lt;code style=\"background: #73ccf5;\"&gt;htop &lt;/code&gt;--&amp;gt; mejora en visualización de procesos que se están\n        ejecutando en RAM y CPU. Para Centos 7 debe tener una previa instalación.\n        &lt;br&gt;\n        &lt;code style=\"background: #73ccf5;\"&gt;ip a &lt;/code&gt; --&amp;gt; Obtener información de red. También se puede realizar\n        uso de ifconfig\n        &lt;br&gt;\n        &lt;code style=\"background: #73ccf5;\"&gt;ip -4 a &lt;/code&gt;--&amp;gt; Me permite ver información de red IPv4 (Internet\n        Protocol Version)\n        &lt;br&gt;\n        &lt;code style=\"background: #73ccf5;\"&gt;hostname &lt;/code&gt;--&amp;gt; Identificación del equipo en las redes.\n        &lt;br&gt;\n        &lt;code style=\"background: #73ccf5;\"&gt;route -n &lt;/code&gt;--&amp;gt; Obtener puerta de enlace predeterminada del equipo\n        para conexión a Internet\n        &lt;br&gt;\n        &lt;code style=\"background: #73ccf5;\"&gt;nslookup {nombre_dominio} &lt;/code&gt;--&amp;gt; Identificar las ip de ciertos\n        dominios en específico. También sirve para identificar si el DNS está resolviendo correctamente los nombres\n        y las IP. También se puede buscar por la IP.\n        &lt;br&gt;\n        Base de datos RPM ruta: /var/lib/rpm\n        &lt;br&gt;\n        &lt;code style=\"background: #73ccf5;\"&gt;rpm -qa &lt;/code&gt;--&amp;gt; listar todos los paquetes instalados.\n        &lt;br&gt;\n        &lt;code style=\"background: #73ccf5;\"&gt;rpm -e paquete.rpm &lt;/code&gt;--&amp;gt; Remover un paquete del sistema\n        &lt;br&gt;\n        &lt;code style=\"background: #73ccf5;\"&gt;apt install {nombre_paquete} &lt;/code&gt; --&amp;gt; Instalar paquete en Debian.\n        &lt;br&gt;\n        &lt;code style=\"background: #73ccf5;\"&gt;dpkg -l &lt;/code&gt;--&amp;gt; Listar todos los paquetes instalados en Debian.\n        &lt;br&gt;\n        &lt;code style=\"background: #73ccf5;\"&gt;sudo dpkg-reconfigure tzdata &lt;/code&gt;--&amp;gt; Cambiar zona horaria de\n        servidor.\n        &lt;br&gt;\n        &lt;code style=\"background: #73ccf5;\"&gt;whoami &lt;/code&gt;--&amp;gt; Consultar el usuario con el que estoy logueado\n        &lt;br&gt;\n        &lt;code style=\"background: #73ccf5;\"&gt;cat /etc/passwd &lt;/code&gt; --&amp;gt; Consultar todos los usuarios del sistema\n        operativo.\n        &lt;br&gt;\n        &lt;code style=\"background: #73ccf5;\"&gt;passwd &lt;/code&gt;--&amp;gt; Cambiar contraseña usuario\n        &lt;br&gt;\n        &lt;code style=\"background: #73ccf5;\"&gt;useradd {nombre_usuario} &lt;/code&gt;-&amp;gt; Crear usuario nuevo.\n        &lt;br&gt;\n        &lt;code style=\"background: #73ccf5;\"&gt;adduser {nombre_usuario} &lt;/code&gt;-&amp;gt; Crear usuario con carpeta en\n        /home/{nombre_usuario}\n        &lt;br&gt;\n        &lt;code style=\"background: #73ccf5;\"&gt;userdel {nombre_usuario} &lt;/code&gt;--&amp;gt; Borrar usuario.\n        &lt;br&gt;\n        &lt;code style=\"background: #73ccf5;\"&gt;sudo gpasswd -a {nombre_usuario} wheel &lt;/code&gt;--&amp;gt; agregar usuario a\n        grupo\n        wheel\n        &lt;br&gt;\n        &lt;code style=\"background: #73ccf5;\"&gt;sudo gpasswd -d {nombre_usuario} wheel &lt;/code&gt;--&amp;gt; borrar usuario de\n        grupo\n        wheel\n        &lt;br&gt;\n        &lt;code style=\"background: #73ccf5;\"&gt;PAM &lt;/code&gt;--&amp;gt; Pluggable Authentication Modules\n        &lt;br&gt;\n        &lt;code style=\"background: #73ccf5;\"&gt;sudo su - usuario &lt;/code&gt;--&amp;gt; Cambiar de usuario solicitando la\n        contraseña\n        del usuario actual.\n        &lt;br&gt;\n        &lt;code style=\"background: #73ccf5;\"&gt;groups nodejs &lt;/code&gt; --&amp;gt; Validar grupos de usuario actual. Cuando un\n        usuario se crea por defecto se asocia al mismo grupo.\n        &lt;br&gt;\n        &lt;code style=\"background: #73ccf5;\"&gt;sudo gpasswd -a nodejs sudo&lt;/code&gt;\n        &lt;br&gt;\n        &lt;code style=\"background: #73ccf5;\"&gt;sudo gpasswd -d nodejs sudo&lt;/code&gt;\n        &lt;br&gt;\n        &lt;code style=\"background: #73ccf5;\"&gt;usermod -aG sudo nodejs&lt;/code&gt;\n        &lt;br&gt;\n        &lt;code style=\"background: #73ccf5;\"&gt;sudo -l &lt;/code&gt; --&amp;gt; ver permisos de usuario en grupo sudo\n        &lt;br&gt;\n        &lt;code style=\"background: #73ccf5;\"&gt;pwscore &lt;/code&gt; --&amp;gt; Score de password test\n        &lt;br&gt;\n        &lt;code style=\"background: #73ccf5;\"&gt;ulimit &lt;/code&gt; --&amp;gt; Validar límites que tiene el usuario para\n        ejecuciones.\n        &lt;br&gt;\n        &lt;code style=\"background: #73ccf5;\"&gt;ulimit -a &lt;/code&gt; --&amp;gt; Ver estadísticas de procesos de ejecución\n        disponibles para un usuario.\n        &lt;br&gt;\n        &lt;code style=\"background: #73ccf5;\"&gt;nano /etc/security/time.conf&lt;/code&gt; --&amp;gt; Mejorar permisos de acceso SSH\n        &lt;br&gt;\n        &lt;code style=\"background: #73ccf5;\"&gt;vim /etc/ssh/sshd_config&lt;/code&gt;\n        &lt;br&gt;\n        &lt;code style=\"background: #73ccf5;\"&gt;ssh-keygen &lt;/code&gt;--&amp;gt; Generar una nueva clave pública y privada. Se\n        guarda por defecto en /home/{nombre_usuario}/.ssh/id_rsa con el algoritmo rsa\n        &lt;br&gt;\n        &lt;code style=\"background: #73ccf5;\"&gt;ssh-copy-id -i ~/.ssh/id_rsa.pub {ruta_servidor ej.\n            psicol@psicol.co} &lt;/code&gt; --&amp;gt; Copiar llave pública en nuevo servidor\n        &lt;br&gt;\n        RED - DNS\n        &lt;br&gt;\n        &lt;code style=\"background: #73ccf5;\"&gt;netstat -ltnp &lt;/code&gt;--&amp;gt; entrega información de puertos y direcciones\n        IP\n        habilitadas para escucha con el programa que está realizando uso de la conexión.\n        &lt;br&gt;&lt;code style=\"background: #73ccf5;\"&gt;netstat -tulpn &lt;/code&gt;--&amp;gt; validar puertos que tienen un proceso\n        activo.\n        &lt;br&gt;&lt;code style=\"background: #73ccf5;\"&gt;dig {dominio} &lt;/code&gt;--&amp;gt; Información adicional de dominio como\n        dirección IP.\n        &lt;br&gt;&lt;code style=\"background: #73ccf5;\"&gt;/etc/named.conf&lt;/code&gt;\n        &lt;br&gt;&lt;code style=\"background: #73ccf5;\"&gt;/etc/rndc.key &lt;/code&gt; --&amp;gt; configurar la clave que se puede usar\n        para\n        obtener acceso al nombre de dominio.\n        &lt;br&gt;&lt;code style=\"background: #73ccf5;\"&gt;named -v &lt;/code&gt; --&amp;gt; ver versión de bind.\n        &lt;br&gt;&lt;code style=\"background: #73ccf5;\"&gt;service bind9 status&lt;/code&gt; --&amp;gt; validar estado de bind9\n        &lt;br&gt;&lt;code style=\"background: #73ccf5;\"&gt;/var/log&lt;/code&gt; --&amp;gt; Ubicación de logs en el sistema.\n        &lt;br&gt;&lt;code style=\"background: #73ccf5;\"&gt;journalctl -fu {servicio}&lt;/code&gt; --&amp;gt; Log - seguimiento de lo que\n        está\n        haciendo el programa en tiempo real.\n        &lt;br&gt;&lt;code style=\"background: #73ccf5;\"&gt;journalctl --disk-usage&lt;/code&gt; --&amp;gt; consultar consumo de\n        almacemiento\n        de journalctl.\n        &lt;br&gt;&lt;code style=\"background: #73ccf5;\"&gt;journalctl --list-boots&lt;/code&gt; --&amp;gt; Información de reinicios de\n        máquina.\n        &lt;br&gt;&lt;code style=\"background: #73ccf5;\"&gt;PAM&lt;/code&gt; --&amp;gt; Pluggable Authentication Modules\n        &lt;br&gt;&lt;code style=\"background: #73ccf5;\"&gt;journalctl -p crit&lt;/code&gt; --&amp;gt; revisar log de servicios críticos\n        que\n        se están ejecutando.\n        &lt;br&gt;&lt;code style=\"background: #73ccf5;\"&gt;curl -I {domain}&lt;/code&gt; --&amp;gt; ver cabeceras de servidor relacionado\n        al\n        dominio consultado.\n        &lt;br&gt;&lt;code style=\"background: #73ccf5;\"&gt;grep -l \"word_search\" ./*&lt;/code&gt; --&amp;gt; Buscar término en varios\n        archivos y directorios.\n\n        &lt;br&gt;&lt;code style=\"background: #73ccf5;\"&gt;a2enmode&lt;/code&gt; --&amp;gt; Solicitud a apache de activar un módulo.\n\n        &lt;br&gt;&lt;code style=\"background: #73ccf5;\"&gt;httpd -M&lt;/code&gt; --&amp;gt; Ver módulos activos para el servicio httpd.\n\n        &lt;blockquote class=\"dx-blockquote-note\"&gt;\n            NGINX Amplify es una herramienta SaaS que permite realizar el monitoreo de NGINX y NGINX Plus. Los\n            factores que permite monitorear son el rendimiento, configuraciones con análisis estático. parámetros\n            del sistema operativo, así como PHP-FPM, bases de datos y otros componentes. Nginx Amplify es de fácil\n            configuración y llevar control de nuestros servidores es agradable por los tableros de administración\n            que posee.\n            https://www.nginx.com/products/nginx-amplify/\n        &lt;/blockquote&gt;\n\n        &lt;blockquote class=\"dx-blockquote-note\"&gt;Una vez realicemos la instalación de MySQL, podemos utilizar el\n            usuario que es creado con la instalación del paquete mysql-server en la siguiente ruta\n            /etc/mysql/debian.conf\n            &lt;br&gt;\n            Proceso de instalación seguro de Mysql:\n            &lt;br&gt;\n            -&amp;gt; Ejecutamos los siguientes comandos:\n            &lt;br&gt;\n            sudo mysql_secure_installation\n            &lt;br&gt;\n            --&amp;gt;Ingresamos contraseña, deshabilitar usuarios anónimos, deshabilitar login remoto y remover base de\n            datos de prueba.\n        &lt;/blockquote&gt;\n\n        &lt;h2 id=\"3-logs\" class=\"dx-anchor\"&gt;&lt;a class=\"dx-anchor__icon\" href=\"#3-logs\" aria-hidden=\"true\"&gt;&lt;/a&gt;Logs&lt;/h2&gt;\n        &lt;code style=\"background: #73ccf5;\"&gt;find /etc -typef&lt;/code&gt;\n        &lt;br&gt;&lt;code style=\"background: #73ccf5;\"&gt;ls -l /etc&lt;/code&gt;\n        &lt;br&gt;&lt;code style=\"background: #73ccf5;\"&gt;find /var/log/ -name \"*.log\" -type f&lt;/code&gt; --&amp;gt; Búsqueda de logs\n        &lt;br&gt;&lt;code style=\"background: #73ccf5;\"&gt;find /var/log/ -iname \"*.LOG\" -type f&lt;/code&gt; --&amp;gt; Realizar búsqueda\n        de\n        logs de forma recursiva sin tener en cuenta las mayúsculas o minúsculas.\n        &lt;br&gt;&lt;code style=\"background: #73ccf5;\"&gt;find /var/log/ ! -iname \"*.LOG\" -type f&lt;/code&gt; --&amp;gt; Buscar todos\n        los\n        archivos que no cumplan con las reglas establecidas.\n        &lt;br&gt;&lt;code style=\"background: #73ccf5;\"&gt;sudo find /etc/ -mtime 10&lt;/code&gt; --&amp;gt; Ver los archivos que fueron\n        modificados hace 10 minutos\n        &lt;br&gt;&lt;code style=\"background: #73ccf5;\"&gt;find /etc/ -mtime 10000 2 &amp;gt; /dev/null &lt;/code&gt; --&amp;gt; el número 2\n        indica\n        los archivos de error\n        &lt;br&gt;&lt;code style=\"background: #73ccf5;\"&gt;grep \"server\" /etc/nginx/sites-available/default&lt;/code&gt;\n        &lt;br&gt;&lt;code style=\"background: #73ccf5;\"&gt;awk \'{print$1}\' /var/log/apache2/access_log&lt;/code&gt;\n        &lt;br&gt;&lt;code style=\"background: #73ccf5;\"&gt;awk \'{print$1}\' /var/log/apache2/access_log | sort | uniq -c&lt;/code&gt;\n        &lt;br&gt;&lt;code style=\"background: #73ccf5;\"&gt;awk \'{print$1}\' /var/log/apache2/access_log | sort | uniq -c | sort\n        -nr&lt;/code&gt;\n        &lt;br&gt;&lt;code style=\"background: #73ccf5;\"&gt;awk \'{print$9}\' /var/log/apache2/access_log | sort | uniq -c | sort\n        -nr&lt;/code&gt;\n        &lt;br&gt;&lt;code style=\"background: #73ccf5;\"&gt;cat /var/log/apache2/access_log&lt;/code&gt;\n        &lt;br&gt;&lt;br&gt;\n        Generar estadísticas LOGS\n        &lt;br&gt;\n        --&amp;gt; Collectd\n        &lt;br&gt;\n        --&amp;gt; Zabbix\n        &lt;br&gt;\n        --&amp;gt; Graphite: https://comtronic.com.au/how-to-install-graphite-on-centos7/\n\n        &lt;h2 id=\"4-bash\" class=\"dx-anchor\"&gt;&lt;a class=\"dx-anchor__icon\" href=\"#4-bash\" aria-hidden=\"true\"&gt;&lt;/a&gt;Bash&lt;/h2&gt;\n\n        &lt;blockquote class=\"dx-blockquote-note\"&gt;\n            &lt;strong&gt;scripts BASH o .sh&lt;/strong&gt;\n            &lt;br&gt;\n            + Al escribir en el lenguaje de comandos, se recomienda hacer un correcto uso de espacios ya que puede\n            generar fallos en la interpretación.\n            &lt;br&gt;\n            + Es importante asignar comilla doble \"\" ya que al asignar por ejemplo comilla simple no va a ser\n            interpretado el comando.\n            &lt;br&gt;\n            + el símbolo &amp;gt;&amp;gt; permite guardar la salida en un archivo sin sobreescribir la anterior.\n            &lt;br&gt;\n            + el símbolo &amp;gt; permite guardar la salida en un archivo sobreescribiendo la anterior.\n        &lt;/blockquote&gt;\n\n        &lt;p&gt;A continuación se presenta ejemplo funcional de generación de backup de base de datos:&lt;/p&gt;\n        &lt;pre class=\"dx-pre-hljs\" id=\"c2cb-target-14\"&gt;&lt;code class=\"hljs bash\"&gt;&lt;span\n                class=\"hljs-meta\"&gt;#!/bin/bash&lt;/span&gt;\n\n</code></pre><p><span class=\"hljs-comment\">#Backup de Base de datos Mysql</span><br><span class=\"hljs-comment\">#autor Robinson Pulgarin Torres</span></p>\n<p>PATH=/usr/<span class=\"hljs-built_in\">local</span>/sbin:/usr/<span class=\"hljs-built_in\">local</span>/bin:/sbin:/bin:/usr/sbin:/usr/bin</p>\n<p><span class=\"hljs-comment\">#Si falla algo en el script de inmediato deje de ejecutar</span><br><span class=\"hljs-built_in\">set</span> <span class=\"hljs-_\">-e</span></p>\n<p><span class=\"hljs-built_in\">readonly</span> SCRIPT_DIR=<span class=\"hljs-string\">\"<span class=\"hljs-variable\">$(cd \"$(dirname \"${BASH_SOURCE[0]}\")</span>\"</span> &amp;&amp; <span class=\"hljs-built_in\">pwd</span>)<span class=\"hljs-string\">\"<br>readonly SCRIPT_NAME=\"</span>$(basename <span class=\"hljs-string\">\"<span class=\"hljs-variable\">$0</span>\"</span>)<span class=\"hljs-string\">\"</span></p>\n<p>function log() {<br>    local readonly level=\"<span class=\"hljs-variable\">$1</span><span class=\"hljs-string\">\"<br>    local readonly message=\"</span><span class=\"hljs-variable\">$2</span><span class=\"hljs-string\">\"<br>    local readonly timestamp=<span class=\"hljs-variable\">$(date +\"%Y-%m-%d %H:%M:%S\")</span> &gt;&amp;2 echo -e \"</span><span class=\"hljs-variable\">${timestamp}</span> [<span class=\"hljs-variable\">${level}</span>] [<span class=\"hljs-variable\">$SCRIPT_NAME</span>] <span class=\"hljs-variable\">${message}</span><span class=\"hljs-string\">\"<br>}</span></p>\n<p>function log_error() {<br>    local readonly message \"<span class=\"hljs-variable\">$1</span><span class=\"hljs-string\">\"<br>    log \"</span>ERROR<span class=\"hljs-string\">\" \"</span><span class=\"hljs-variable\">$message</span><span class=\"hljs-string\">\"<br>}</span></p>\n<p>function assert_is_installed() {<br>    local readonly name=\"<span class=\"hljs-variable\">$1</span><span class=\"hljs-string\">\"</span></p>\n<pre><code>if [[ ! &lt;span class=\"hljs-variable\"&gt;$(command -v ${name})&lt;/span&gt; ]]; then\n    log_error \"&lt;/span&gt;El servicio &lt;span class=\"hljs-string\"&gt;\'$name\'&lt;/span&gt; se requiere, valide instalación&lt;span\n                    class=\"hljs-string\"&gt;\"\n    exit 1\nfi\n\n</code></pre><p>}</p>\n<p>function run() {<br>    assert_is_installed \"mysql<span class=\"hljs-string\">\"<br>    assert_is_installed \"</span>mysqldump<span class=\"hljs-string\">\"<br>    assert_is_installed \"</span>gzip<span class=\"hljs-string\">\"</span></p>\n<pre><code>#assert_is_installed \"&lt;/span&gt;aws&lt;span class=\"hljs-string\"&gt;\"\n\n</code></pre><p>}</p>\n<p>function make_backup() {<br>    local BAK=\"$(<span class=\"hljs-built_in\">echo</span> <span class=\"hljs-variable\">$PWD</span>/mysql)<span class=\"hljs-string\">\"<br>    local MYSQL=\"</span>$(<span class=\"hljs-built_in\">which</span> mysql)<span class=\"hljs-string\">\"<br>    local MYSQLDUMP=\"</span>$(<span class=\"hljs-built_in\">which</span> mysqldump)<span class=\"hljs-string\">\"<br>    local GZIP=\"</span>$(<span class=\"hljs-built_in\">which</span> gzip)<span class=\"hljs-string\">\"<br>    local NOW=\"</span>$(date +<span class=\"hljs-string\">\"+%d-%m-%Y\"</span>)<span class=\"hljs-string\">\"</span></p>\n<pre><code>#local BUCKET=\"&lt;/span&gt;&lt;span class=\"hljs-string\"&gt;\"\n\nUSER=\"&lt;/span&gt;user_name&lt;span class=\"hljs-string\"&gt;\"\nPASS=\"&lt;/span&gt;password&lt;span class=\"hljs-string\"&gt;\"\nHOST=\"&lt;/span&gt;localhost&lt;span class=\"hljs-string\"&gt;\"\nDATABASE=\"&lt;/span&gt;name_database&lt;span class=\"hljs-string\"&gt;\"\n\n[ ! -d \"&lt;/span&gt;&lt;span class=\"hljs-variable\"&gt;$BAK&lt;/span&gt;&lt;span\n                    class=\"hljs-string\"&gt;\" ] &amp;amp;&amp;amp; mkdir -p \"&lt;/span&gt;&lt;span class=\"hljs-variable\"&gt;$BAK&lt;/span&gt;&lt;span\n                    class=\"hljs-string\"&gt;\"\n\nFILE=\"&lt;/span&gt;&lt;span class=\"hljs-variable\"&gt;$BAK&lt;/span&gt;/&lt;span class=\"hljs-variable\"&gt;$DATABASE&lt;/span&gt;&lt;span\n                    class=\"hljs-string\"&gt;\"_\"&lt;/span&gt;$(date +&lt;span class=\"hljs-string\"&gt;\'%Y-%m-%d\'&lt;/span&gt;).sql.gz&lt;span\n                    class=\"hljs-string\"&gt;\"\nSECONDS=0\n\n&lt;span class=\"hljs-variable\"&gt;$MYSQLDUMP&lt;/span&gt; --single-transaction -u&lt;span\n                        class=\"hljs-variable\"&gt;$USER&lt;/span&gt; -p&lt;span class=\"hljs-variable\"&gt;$PASS&lt;/span&gt; -h&lt;span\n                        class=\"hljs-variable\"&gt;$HOST&lt;/span&gt; &lt;span class=\"hljs-variable\"&gt;$DATABASE&lt;/span&gt; | &lt;span\n                        class=\"hljs-variable\"&gt;$GZIP&lt;/span&gt; -9 &amp;gt; &lt;span class=\"hljs-variable\"&gt;$FILE&lt;/span&gt;\n\n#conversion=&lt;span class=\"hljs-variable\"&gt;$duration&lt;/span&gt; /60\necho \"&lt;/span&gt;&lt;span class=\"hljs-variable\"&gt;$SECONDS&lt;/span&gt; seconds&lt;span class=\"hljs-string\"&gt;\"\n#Transferir backup a almacenamiento externo como Amazon.\n#aws s3 cp &lt;span class=\"hljs-variable\"&gt;$BAK&lt;/span&gt; \"&lt;/span&gt;s3://&lt;span class=\"hljs-variable\"&gt;$BUCKET&lt;/span&gt;&lt;span\n                    class=\"hljs-string\"&gt;\" --recursive\n\n</code></pre><p>}</p>\n<p>run<br>make_backup</p><div class=\"dx-pre-meta\"><button class=\"dx-btn dx-btn-copy\" data-c2cb-target=\"c2cb-target-14\" data-dxa=\"sampleCode,copyToClipboard,/documentation/bancolombia/comandos-linux.html|c2cb-target-14\">copy</button></div><br>            <code><br>            </code><p></p>\n<pre><code>        &lt;blockquote class=\"dx-blockquote-note\"&gt;\n            &lt;strong&gt;VARIABLES DE ENTORNO GLOBALES O LOCALES&lt;/strong&gt;\n            &lt;br&gt;\n            + Podemos visualizar las variables predefinidas en la terminal utilizando el comando \'env\'\n            &lt;br&gt;\n            + Podemios crear variables nuevas.\n            &lt;br&gt;\n            + Las variables de entorno globales se encuentran definidas en mayúsculas para diferenciar a las que\n            sean definidas por el administrador.\n            &lt;br&gt;\n            + Ejemplo imprimir variable global: echo $PWD\n        &lt;/blockquote&gt;\n\n        &lt;h2 id=\"5-crontab\" class=\"dx-anchor\"&gt;&lt;a class=\"dx-anchor__icon\" href=\"#5-crontab\" aria-hidden=\"true\"&gt;&lt;/a&gt;Crontab\n        &lt;/h2&gt;\n\n        &lt;p&gt;Para ejecutar nuestra tarea de copia de seguridad debemos hacer uso de cron, el cual es un administrador\n            regular de procesos en segundo plano que comprueba si existen tareas para ejecutar, teniendo en cuenta\n            la hora del sistema.\n\n            Las configuraciones de las tareas a ejecutar se almacenan en el archivo crontab que puede ser editado\n            con el comando crontab -e, si requerimos listar las tareas que tenemos configuradas ejecutamos crontab\n            -l.&lt;/p&gt;\n\n        Para establecer una tarea automatizada con cron se debe seguir un formato específico para definir una tarea\n        como se muestra a continuación:\n        &lt;br&gt;\n        &lt;img src=\"img/crontab.jpg\" alt=\"Crontab\"&gt;\n        &lt;br&gt;\n        &lt;p&gt;Para pruebas &lt;a href=\"https://crontab.guru/\" target=\"_blank\" title=\"external link\"\n                           rel=\"noopener noreferrer\"\n                           class=\"dx-external-link\"&gt;https://crontab.guru/&lt;/a&gt;&lt;/p&gt;\n\n        &lt;h2 id=\"6-seguridad\" class=\"dx-anchor\"&gt;&lt;a class=\"dx-anchor__icon\" href=\"#6-seguridad\"\n                                                  aria-hidden=\"true\"&gt;&lt;/a&gt;Recomendaciones\n            de Seguridad&lt;/h2&gt;\n        &lt;p&gt;Para mejorar las prácticas de seguridad en nuestro servidor, se mencionan a continuación algunos puntos\n            importantes a tener en cuenta:&lt;/p&gt;\n        + Desactivar el usuario root.\n        &lt;br&gt;\n        + No realizar login con usuario y password. Siempre hacerlo por con una llave pública y privada SSH.\n        &lt;br&gt;\n        + Actualizaciones constantes de software.\n        &lt;br&gt;\n        + Evitar el uso de comandos que son inseguros por definición: telnet, comandos r*\n        &lt;br&gt;\n        + Identificación de procesos: usuarios, uso de puertos, accesos ...\n        &lt;br&gt;\n        + Verificar actualizaciones de seguridad e instalarlas en nuestra máquina:\n        &lt;br&gt;\n        &lt;br&gt;\n        yum check-update --security\n        &lt;br&gt;\n        yum update security\n        &lt;blockquote class=\"dx-blockquote-note\"&gt;En el siguiente enlace, se podrá consultar como ha ido en aumento el\n            número de vulnerabilidades encontradas cada año y podemos obtener información de cada una: &lt;a\n                    href=\"https://www.cvedetails.com/browse-by-date.php\" target=\"_blank\" title=\"external link\"\n                    rel=\"noopener noreferrer\"\n                    class=\"dx-external-link\"&gt;https://www.cvedetails.com/browse-by-date.php&lt;/a&gt;\n        &lt;/blockquote&gt;\n\n        &lt;h2 id=\"7-superficie-de-ataque\" class=\"dx-anchor\"&gt;&lt;a class=\"dx-anchor__icon\" href=\"#7-superficie-de-ataque\"\n                                                             aria-hidden=\"true\"&gt;&lt;/a&gt;Superficie de Ataque&lt;/h2&gt;\n        La Superficie de Ataque es el conjunto de vulnerabilidades o datos conocidos que pueden ser explotados por\n        un atacante informático. Cada servicio de nuestras aplicaciones es un nuevo punto de entrada a nuestra red.\n        No solo debemos proteger nuestros servidores, también debemos proteger todos los servicios que corren en él.\n        &lt;br&gt;\n        Lynis es una herramienta que analiza nuestros servidores y para darnos algunas recomendaciones. La\n        estudiaremos más a fondo en una próxima clase. También existen frameworks o manuales como OWASP que nos\n        explican las características de aplicaciones web vulnerables y cómo programarlas de forma segura.\n\n        &lt;h2 id=\"8-firewall\" class=\"dx-anchor\"&gt;&lt;a class=\"dx-anchor__icon\" href=\"#8-firewall\" aria-hidden=\"true\"&gt;&lt;/a&gt;El\n            firewall y\n            sus reglas&lt;/h2&gt;\n\n        Los Firewalls son herramientas que monitorean el tráfico de nuestras redes para identificar amenazas e\n        impedir que afecten nuestro sistema.\n        &lt;br&gt;\n        Recuerda que la seguridad informática es un proceso constante, así que ninguna herramienta (incluyendo el\n        firewall) puede garantizarnos seguridad absoluta.\n        &lt;br&gt;\n        En Ubuntu Server podemos usar ufw (Uncomplicated Firewall) para crear algunas reglas, verificar los puertos\n        que tenemos abiertos y realizar una protección básica de nuestro sistema:\n        &lt;br&gt;\n        &lt;ul&gt;\n            &lt;li&gt;sudo ufw (enable, reset, status): activar, desactivar o ver el estado y reglas de nuestro\n                firewall.\n            &lt;/li&gt;\n            &lt;li&gt;sudo ufw allow numero-puerto: permitir el acceso por medio de un puerto específico. Recuerda que el\n                puerto 22 es por donde trabajamos con SSH.\n            &lt;/li&gt;\n            &lt;li&gt;sudo ufw status numbered: ver el número de nuestras reglas.&lt;/li&gt;\n            &lt;li&gt;sudo ufw delete numero-regla: borrar alguna de nuestras reglas.&lt;/li&gt;\n            &lt;li&gt;sudo ufw allow from numero-ip proto tcp to any port numero-puerto: restringir el acceso de un\n                servicio por alguno de sus puertos a solo un número limitado de IPs específicas.\n            &lt;/li&gt;\n        &lt;/ul&gt;\n\n        &lt;h2 id=\"9-escaneo-de-puertos\" class=\"dx-anchor\"&gt;&lt;a class=\"dx-anchor__icon\" href=\"#9-escaneo-de-puertos\"\n                                                           aria-hidden=\"true\"&gt;&lt;/a&gt;Escaneo de puertos con NMAP y\n            NIKTO desde Kali\n            Linux&lt;/h2&gt;\n        &lt;p&gt;A continuación procedemos a instalar Kali Linux en nuestra máquina virtual descargando el .iso desde la\n            página oficial &lt;a href=\"https://www.kali.org/downloads/\" target=\"_blank\" title=\"external link\"\n                              rel=\"noopener noreferrer\" class=\"dx-external-link\"&gt;https://www.kali.org/downloads/&lt;/a&gt;\n            &lt;br&gt;\n            Frente a cualquier duda frente al proceso de instalación siendo este básico, se recomienda el siguiente\n            video &lt;a href=\"https://www.youtube.com/watch?v=cZYnq0MMSgw\" target=\"_blank\" title=\"external link\"\n                     rel=\"noopener noreferrer\"\n                     class=\"dx-external-link\"&gt;https://www.youtube.com/watch?v=cZYnq0MMSgw&lt;/a&gt;\n        &lt;/p&gt;\n        &lt;blockquote class=\"dx-blockquote-note\"&gt;\n            &lt;strong&gt;Nota: &lt;/strong&gt;durante el proceso de instalación en la máquina virtual, se presentó un fallo el\n            cual fue solucionado visualizando el siguiente video &lt;a\n                href=\"https://www.youtube.com/watch?v=IercdxElf2M\"\n                target=\"_blank\" title=\"external link\"\n                rel=\"noopener noreferrer\" class=\"dx-external-link\"&gt;https://www.youtube.com/watch?v=IercdxElf2M&lt;/a&gt;\n            &lt;br&gt;\n            &lt;br&gt;\n            + Resumen del video: Cambiar las opciones de orden de arranque en \'Sistema\' (Disco duro, óptico,\n            Disquete y Red).\n            &lt;br&gt;\n            + En procesador, habilitar la opción de Características extendidas \'PAE/NX\'\n        &lt;/blockquote&gt;\n        A continuación vamos a utilizar algunos software compatibles con Kali Linux que nos permite realizar algunos\n        escaneos básicos. Software:\n        &lt;br&gt;\n        + nmap: mapeo de red con ciertos parámetros específicos. Parámetros\n        &lt;br&gt;\n        -sV: muestre toda la información.\n        &lt;br&gt;\n        -sC: verifique desde el motor de scripts si ya existe un script disponible que permite explotar\n        vulnerabilidades.\n        &lt;br&gt;\n        -p-: escaneo completo de todos los puertos del servidor-\n        -O: identificar sistema operativo que está corriendo en la máquina.\n        -oA: guarde salida en archivo.\n        &lt;br&gt;\n        + nikto: escaneo adicional en servidor web (protocolo http). Parámetros:\n        &lt;br&gt;\n        -h: host\n        -o: salida en formato de texto\n        &lt;p&gt;Ejemplos de ejecución de comandos:&lt;/p&gt;\n        nmap -sV -sC -p- -O -oA {nombre_archivo} {IP_Servidor} --&amp;gt; escaneo de todos los puertos de la dirección\n        IP\n        &lt;br&gt;\n        nmap -sV -sC -O -oA {nombre_archivo} {IP_Servidor} --&amp;gt; escaneo general.\n        &lt;br&gt;\n        nikto -h {ip_servidor} -o {archivo.txt} --&amp;gt; validar actualización de versiones, recomendaciones de\n        mejoras\n        de seguridad como protección XSS y lectura de archivos en directorios.\n\n        &lt;h2 id=\"10-auditoria-en-seguridad\" class=\"dx-anchor\"&gt;&lt;a class=\"dx-anchor__icon\"\n                                                                href=\"#10-auditoria-en-seguridad\"\n                                                                aria-hidden=\"true\"&gt;&lt;/a&gt;Lynis: Herramientas de\n            auditoria de\n            seguridad en Linux&lt;/h2&gt;\n        Lynis es una herramienta de auditoría de seguridad de código abierto que se usa ampliamente en varios\n        sistemas operativos tipo Unix. Con Lynis, los administradores de sistemas y los profesionales de seguridad\n        pueden realizar análisis exhaustivos de seguridad en todo el sistema en cuestión de minutos.\n        &lt;br&gt;\n        A continuación explicaremos como instalar y usar Lynis en CentOS 7.\n        &lt;br&gt;\n        &lt;h2&gt;Actualiza el sistema&lt;/h2&gt;\n        Inicie sesión desde un terminal SSH como usuario de sudo y luego actualice el sistema de la siguiente\n        manera:\n        &lt;br&gt;\n        sudo yum install epel-release -y\n        &lt;br&gt;\n        sudo yum update -y\n\n        &lt;h2&gt;Instalar Lynis&lt;/h2&gt;\n        En CentOS 7, puede instalar Lynis fácilmente utilizando el repositorio EPEL YUM que se instaló\n        anteriormente:\n        &lt;br&gt;\n        sudo yum install lynis -y\n        &lt;br&gt;\n        Una vez instalado, para realizar un análisis general de nuestro servidor bastaría con la ejecución del\n        comando:\n        &lt;pre class=\"dx-pre-hljs\" id=\"c2cb-target-15\"&gt;&lt;code class=\"hljs java\"&gt;root&lt;span\n                class=\"hljs-meta\"&gt;@server&lt;/span&gt;.enlacepos.com [~] sudo lynis audit system&lt;/code&gt;&lt;div\n                class=\"dx-pre-meta\"&gt;&lt;button class=\"dx-btn dx-btn-copy\" data-c2cb-target=\"c2cb-target-15\"\n                                            data-dxa=\"sampleCode,copyToClipboard,/documentation/bancolombia/comandos-linux.html|c2cb-target-15\"&gt;copy&lt;/button&gt;&lt;/div&gt;&lt;/pre&gt;\n\n        &lt;h2 id=\"11-configuracion-de-nodejs\" class=\"dx-anchor\"&gt;&lt;a class=\"dx-anchor__icon\"\n                                                                 href=\"#11-configuracion-de-nodejs\"\n                                                                 aria-hidden=\"true\"&gt;&lt;/a&gt;Configuración de Node.js en\n            un ambiente\n            productivo&lt;/h2&gt;\n        Inicialmente vamos a realizar la instalación de nodejs y npm:\n        &lt;pre class=\"dx-pre-hljs\" id=\"c2cb-target-16\"&gt;&lt;code class=\"hljs java\"&gt;root&lt;span\n                class=\"hljs-meta\"&gt;@server&lt;/span&gt;.enlacepos.com [~] yum install nodejs&lt;br&gt;root&lt;span\n                class=\"hljs-meta\"&gt;@server&lt;/span&gt;.enlacepos.com [~] yum install npm&lt;/code&gt;&lt;div class=\"dx-pre-meta\"&gt;&lt;button\n                class=\"dx-btn dx-btn-copy\" data-c2cb-target=\"c2cb-target-16\"\n                data-dxa=\"sampleCode,copyToClipboard,/documentation/bancolombia/comandos-linux.html|c2cb-target-16\"&gt;copy&lt;/button&gt;&lt;/div&gt;&lt;/pre&gt;\n        &lt;blockquote class=\"dx-blockquote-note\"&gt;\n            npm es el sistema de gestión de paquetes por defecto para Node.js, un entorno de ejecución para\n            JavaScript.\n        &lt;/blockquote&gt;\n        Descarga del repositorio con el proyecto de Node.js:\n        &lt;pre class=\"dx-pre-hljs\" id=\"c2cb-target-17\"&gt;&lt;code class=\"hljs php\"&gt;git &lt;span\n                class=\"hljs-keyword\"&gt;clone&lt;/span&gt; https:&lt;span\n                class=\"hljs-comment\"&gt;//github.com/edisoncast/linux-platzi&lt;/span&gt;&lt;/code&gt;&lt;div class=\"dx-pre-meta\"&gt;&lt;button\n                class=\"dx-btn dx-btn-copy\" data-c2cb-target=\"c2cb-target-17\"\n                data-dxa=\"sampleCode,copyToClipboard,/documentation/bancolombia/comandos-linux.html|c2cb-target-17\"&gt;copy&lt;/button&gt;&lt;/div&gt;&lt;/pre&gt;\n        &lt;code&gt;\n        &lt;/code&gt;Instalación de Node.js:\n        &lt;pre class=\"dx-pre-hljs\" id=\"c2cb-target-18\"&gt;&lt;code class=\"hljs\"&gt;sudo apt install nodejs npm&lt;/code&gt;&lt;div\n                class=\"dx-pre-meta\"&gt;&lt;button class=\"dx-btn dx-btn-copy\" data-c2cb-target=\"c2cb-target-18\"\n                                            data-dxa=\"sampleCode,copyToClipboard,/documentation/bancolombia/comandos-linux.html|c2cb-target-18\"&gt;copy&lt;/button&gt;&lt;/div&gt;&lt;/pre&gt;\n        &lt;code&gt;\n        &lt;/code&gt;\n        Descarga e instalación de la versión 10 de Node.js:\n        &lt;pre class=\"dx-pre-hljs\" id=\"c2cb-target-19\"&gt;&lt;code class=\"hljs bash\"&gt;curl &lt;span class=\"hljs-_\"&gt;-s&lt;/span&gt;L https://deb.nodesource.com/setup_10.x -o node_setup.sh&lt;br&gt;sudo bash node_setup.sh&lt;br&gt;sudo apt-get install gcc g++ make&lt;br&gt;sudo apt-get install -y nodejs&lt;/code&gt;&lt;div\n                class=\"dx-pre-meta\"&gt;&lt;button class=\"dx-btn dx-btn-copy\" data-c2cb-target=\"c2cb-target-19\"\n                                            data-dxa=\"sampleCode,copyToClipboard,/documentation/bancolombia/comandos-linux.html|c2cb-target-19\"&gt;copy&lt;/button&gt;&lt;/div&gt;&lt;/pre&gt;\n        &lt;code&gt;\n        &lt;/code&gt;\n        Creación de un usuario para manejar los procesos de Node.js:\n        &lt;pre class=\"dx-pre-hljs\" id=\"c2cb-target-20\"&gt;&lt;code class=\"hljs\"&gt;sudo adduser nodejs&lt;/code&gt;&lt;div\n                class=\"dx-pre-meta\"&gt;&lt;button\n                class=\"dx-btn dx-btn-copy\" data-c2cb-target=\"c2cb-target-20\"\n                data-dxa=\"sampleCode,copyToClipboard,/documentation/bancolombia/comandos-linux.html|c2cb-target-20\"&gt;copy&lt;/button&gt;&lt;/div&gt;&lt;/pre&gt;\n        &lt;code&gt;\n        &lt;/code&gt;\n        Creación del script /lib/systemd/system/platzi@.service para que el servicio de Node.js arranque con el\n        sistema operativo:\n        &lt;pre class=\"dx-pre-hljs\" id=\"c2cb-target-21\"&gt;&lt;code class=\"hljs ruby\"&gt;[Unit]&lt;br&gt;Description=Balanceo de carga para Platzi&lt;br&gt;Documentation=&lt;span\n                class=\"hljs-symbol\"&gt;https:&lt;/span&gt;/&lt;span class=\"hljs-regexp\"&gt;/github.com/edisoncast&lt;/span&gt;&lt;span\n                class=\"hljs-regexp\"&gt;/linux-platzi&lt;/span&gt;&lt;br&gt;&lt;span\n                class=\"hljs-regexp\"&gt;After=network.target&lt;/span&gt;&lt;br&gt;&lt;span\n                class=\"hljs-regexp\"&gt;[Service]&lt;/span&gt;&lt;br&gt;&lt;span\n                class=\"hljs-regexp\"&gt;Environment=PORT=%i&lt;/span&gt;&lt;br&gt;&lt;span\n                class=\"hljs-regexp\"&gt;Type=simple&lt;/span&gt;&lt;br&gt;&lt;span class=\"hljs-regexp\"&gt;User=nodejs&lt;/span&gt;&lt;br&gt;&lt;span\n                class=\"hljs-regexp\"&gt;WorkingDirectory=/home&lt;/span&gt;&lt;span class=\"hljs-regexp\"&gt;/nodejs/linux&lt;/span&gt;-platzi&lt;br&gt;ExecStart=&lt;span\n                class=\"hljs-regexp\"&gt;/usr/bin&lt;/span&gt;&lt;span class=\"hljs-regexp\"&gt;/node /home&lt;/span&gt;&lt;span\n                class=\"hljs-regexp\"&gt;/nodejs/linux&lt;/span&gt;-platzi/server.js&lt;br&gt;Restart-on=failure&lt;br&gt;[Install]&lt;br&gt;WantedBy=multi-user.target&lt;/code&gt;&lt;div\n                class=\"dx-pre-meta\"&gt;&lt;button class=\"dx-btn dx-btn-copy\" data-c2cb-target=\"c2cb-target-21\"\n                                            data-dxa=\"sampleCode,copyToClipboard,/documentation/bancolombia/comandos-linux.html|c2cb-target-21\"&gt;copy&lt;/button&gt;&lt;/div&gt;&lt;/pre&gt;\n        &lt;code&gt;\n        &lt;/code&gt;\n\n        &lt;h2 id=\"12-comando-ls\" class=\"dx-anchor\"&gt;&lt;a class=\"dx-anchor__icon\" href=\"#12-comando-ls\"\n                                                    aria-hidden=\"true\"&gt;&lt;/a&gt;Comando\n            ls&lt;/h2&gt;\n        &lt;div&gt;&lt;h2&gt;Comandos para trabajar desde nuestra ubicación&lt;/h2&gt;\n            &lt;p&gt;Lista los archivos que se encuentran en el directorio sobre el que estamos trabajando:&lt;/p&gt;\n            &lt;pre class=\"dx-pre-hljs\" id=\"c2cb-target-22\"&gt;&lt;code class=\"hljs markdown\"&gt;&lt;span class=\"hljs-quote\"&gt;&lt;span\n                    class=\"hljs-quote\"&gt;&amp;gt; ls&lt;/span&gt;&lt;/span&gt;\n\n</code></pre><p></p><div class=\"dx-pre-meta\"><button class=\"dx-btn dx-btn-copy\" data-c2cb-target=\"c2cb-target-22\" data-dxa=\"sampleCode,copyToClipboard,/documentation/bancolombia/comandos-linux.html|c2cb-target-22\">copy</button></div><br>                <p>Lista todos los archivos incluyendo aquellos que se han definido como ocultos:</p><br>                <pre class=\"dx-pre-hljs\" id=\"c2cb-target-23\"><code class=\"hljs stylus bash\">&gt; ls <span class=\"hljs-_\">-</span><span class=\"hljs-selector-tag\"><span class=\"hljs-selector-tag\"><span class=\"hljs-_\">a</span></span></span><br></code><div class=\"dx-pre-meta\"><button class=\"dx-btn dx-btn-copy\" data-c2cb-target=\"c2cb-target-23\" data-dxa=\"sampleCode,copyToClipboard,/documentation/bancolombia/comandos-linux.html|c2cb-target-23\">copy</button></div></pre><br>                <p>Todos los directorios contienen los archivos <strong><code>.</code></strong> y<br>                    <strong><code>..</code></strong>, estos son punteros a directorios.</p><br>                <pre class=\"dx-pre-hljs\" id=\"c2cb-target-24\"><code class=\"hljs applescript\">.. <span class=\"hljs-comment\"><span class=\"hljs-comment\">--&gt; directorio padre</span></span><br>. <span class=\"hljs-comment\"><span class=\"hljs-comment\">--&gt; directorio actual</span></span><br></code><div class=\"dx-pre-meta\"><button class=\"dx-btn dx-btn-copy\" data-c2cb-target=\"c2cb-target-24\" data-dxa=\"sampleCode,copyToClipboard,/documentation/bancolombia/comandos-linux.html|c2cb-target-24\">copy</button></div></pre><br>                <p><strong>Otros parámetros que puedes usar con el comando <code>ls</code>:</strong></p><br>                <p>Ordena los archivos por fecha de modificación:</p><br>                <pre class=\"dx-pre-hljs\" id=\"c2cb-target-25\"><code class=\"hljs markdown bash\"><span class=\"hljs-quote\"><span class=\"hljs-quote\">&gt; ls <span class=\"hljs-_\">-lt</span></span></span><br></code><div class=\"dx-pre-meta\"><button class=\"dx-btn dx-btn-copy\" data-c2cb-target=\"c2cb-target-25\" data-dxa=\"sampleCode,copyToClipboard,/documentation/bancolombia/comandos-linux.html|c2cb-target-25\">copy</button></div></pre><br>                <p>Ordena los archivos por fecha de modificación de forma descendente:</p><br>                <pre class=\"dx-pre-hljs\" id=\"c2cb-target-26\"><code class=\"hljs markdown\"><span class=\"hljs-quote\"><span class=\"hljs-quote\">&gt; ls -ltr</span></span><br>                 </code><div class=\"dx-pre-meta\"><button class=\"dx-btn dx-btn-copy\" data-c2cb-target=\"c2cb-target-26\" data-dxa=\"sampleCode,copyToClipboard,/documentation/bancolombia/comandos-linux.html|c2cb-target-26\">copy</button></div></pre><br>                <p>Ordena elementos primero por nombre y después por extensión:</p><br>                <pre class=\"dx-pre-hljs\" id=\"c2cb-target-27\"><code class=\"hljs cos\">&gt; ls -<span class=\"hljs-keyword\"><span class=\"hljs-keyword\">x</span></span><br></code><div class=\"dx-pre-meta\"><button class=\"dx-btn dx-btn-copy\" data-c2cb-target=\"c2cb-target-27\" data-dxa=\"sampleCode,copyToClipboard,/documentation/bancolombia/comandos-linux.html|c2cb-target-27\">copy</button></div></pre><br>                <p>Ordena los elementos primero por extensión y luego por nombre:</p><br>                <pre class=\"dx-pre-hljs\" id=\"c2cb-target-28\"><code class=\"hljs cos\">&gt; ls -<span class=\"hljs-keyword\"><span class=\"hljs-keyword\">X</span></span><br></code><div class=\"dx-pre-meta\"><button class=\"dx-btn dx-btn-copy\" data-c2cb-target=\"c2cb-target-28\" data-dxa=\"sampleCode,copyToClipboard,/documentation/bancolombia/comandos-linux.html|c2cb-target-28\">copy</button></div></pre><br>                <p>Muestra toda la información: usuario, grupo, permisos, tamaño, fecha y hora de creación.</p><br>                <pre class=\"dx-pre-hljs\" id=\"c2cb-target-29\"><code class=\"hljs stata bash\">&gt; <span class=\"hljs-keyword\"><span class=\"hljs-keyword\">ls</span></span> <span class=\"hljs-_\">-</span><span class=\"hljs-keyword\"><span class=\"hljs-keyword\"><span class=\"hljs-_\">l</span></span></span><br></code><div class=\"dx-pre-meta\"><button class=\"dx-btn dx-btn-copy\" data-c2cb-target=\"c2cb-target-29\" data-dxa=\"sampleCode,copyToClipboard,/documentation/bancolombia/comandos-linux.html|c2cb-target-29\">copy</button></div></pre><br>                <p>Muestra la misma información que ls -l pero con las unidades de tamaño en KB, MB:</p><br>                <pre class=\"dx-pre-hljs\" id=\"c2cb-target-30\"><code class=\"hljs vim\">&gt; <span class=\"hljs-keyword\"><span class=\"hljs-keyword\">ls</span></span> -<span class=\"hljs-keyword\"><span class=\"hljs-keyword\">lh</span></span><br></code><div class=\"dx-pre-meta\"><button class=\"dx-btn dx-btn-copy\" data-c2cb-target=\"c2cb-target-30\" data-dxa=\"sampleCode,copyToClipboard,/documentation/bancolombia/comandos-linux.html|c2cb-target-30\">copy</button></div></pre><br>                <p>Muestra el contenido de todos los subdirectorios de forma recursiva:</p><br>                <pre class=\"dx-pre-hljs\" id=\"c2cb-target-31\"><code class=\"hljs stata\">&gt; <span class=\"hljs-keyword\"><span class=\"hljs-keyword\">ls</span></span> -<span class=\"hljs-built_in\"><span class=\"hljs-built_in\">R</span></span><br></code><div class=\"dx-pre-meta\"><button class=\"dx-btn dx-btn-copy\" data-c2cb-target=\"c2cb-target-31\" data-dxa=\"sampleCode,copyToClipboard,/documentation/bancolombia/comandos-linux.html|c2cb-target-31\">copy</button></div></pre><br>                <p>Ordena los resultados por tamaño de archivo:</p><br>                <pre class=\"dx-pre-hljs\" id=\"c2cb-target-32\"><code class=\"hljs stata\">&gt; <span class=\"hljs-keyword\"><span class=\"hljs-keyword\">ls</span></span> -<span class=\"hljs-built_in\"><span class=\"hljs-built_in\">S</span></span><br></code><div class=\"dx-pre-meta\"><button class=\"dx-btn dx-btn-copy\" data-c2cb-target=\"c2cb-target-32\" data-dxa=\"sampleCode,copyToClipboard,/documentation/bancolombia/comandos-linux.html|c2cb-target-32\">copy</button></div></pre><br>                <h2>Comandos para cambiar de ubicación</h2><br>                <p>Print Working Directory: se usa para mostrar el directorio actual en el que nos encontramos<br>                    trabajando.</p><br>                <pre class=\"dx-pre-hljs\" id=\"c2cb-target-33\"><code class=\"hljs bash\">&gt; <span class=\"hljs-built_in\"><span class=\"hljs-built_in\"><span class=\"hljs-built_in\">pwd</span></span></span><br></code><div class=\"dx-pre-meta\"><button class=\"dx-btn dx-btn-copy\" data-c2cb-target=\"c2cb-target-33\" data-dxa=\"sampleCode,copyToClipboard,/documentation/bancolombia/comandos-linux.html|c2cb-target-33\">copy</button></div></pre><p></p>\n<pre><code>            &lt;h2 id=\"13-utilidades-batch\" class=\"dx-anchor\"&gt;&lt;a class=\"dx-anchor__icon\" href=\"#13-utilidades-batch\"\n                                                              aria-hidden=\"true\"&gt;&lt;/a&gt;Utilidades Batch&lt;/h2&gt;\n            &lt;h3&gt;Utilidades básicas&lt;/h3&gt;\n            head {name_file}: devuelve las 10 líneas iniciales\n            &lt;br&gt;\n            tail {name_file}: devuelve las últimas 10 líneas\n            &lt;br&gt;\n            cat {name_file}: ver un archivo\n            &lt;br&gt;\n            less {name_file}: ver un archivo con paginación\n            &lt;br&gt;\n            Adicional se puede hacer uso del modificador -n {lines} en head y tail\n            &lt;h3&gt;Utilidades avanzadas&lt;/h3&gt;\n            Grep: esta utilidad permite trabajar con expresiones regulares.\n            &lt;br&gt;\n            Ejemplos de uso de grep:\n            grep -i: no tenga en cuenta mayúsculas o minúsculas\n            &lt;br&gt;\n            grep -r: realizar la búsqueda de manera recursiva.\n            &lt;br&gt;\n            Sed (Stream editor): esta utilidad permite modificar el fujo\n            &lt;br&gt;\n            awk: usado comúnmente para procesar archivos de texto, por ejemplo .csv\n            &lt;br&gt;\n            Por ejemplo:\n            &lt;pre&gt;&lt;code&gt;$ awk \'{print $1}\' myfile&lt;/code&gt;&lt;/pre&gt;\n            Imprime la primer palabra de cada línea.\n        &lt;/div&gt;\n        &lt;h2 id=\"14-pipes\" class=\"dx-anchor\"&gt;Pipes o tuberías&lt;/h2&gt;\n        El pipe nos permitirá tomar la salida de un proceso y encadenarla al siguiente.\n        &lt;br&gt;\n        Así cómo encadenamos la ejecución de dos programas podemos hacerlo con tres, cinco, o con la n cantidad que necesitemos.\n        &lt;br&gt;\n        El siguiente ejemplo podemos ver la salida de un resultado largo en varias iteraciones con more:\n        &lt;pre&gt;&lt;code&gt;$ ls -lh | more&lt;/code&gt;&lt;/pre&gt;\n        * Con enter nos muestra líneas adicionales y con barra espaciadora nos muestra nuevos bloques según el resultado.\n        &lt;br&gt;\n        Otro ejemplo es con la utilidad wc que nos permite contar el número de caracteres, palabras o líneas que hay en un flujo:\n        &lt;pre&gt;&lt;code&gt;$ cat {name_file} | wc -l&lt;/code&gt;&lt;/pre&gt;\n        * wc -l para número de líneas.\n</code></pre></div>', '2020-06-30 04:37:35');
INSERT INTO `sig_docs` (`id`, `nombre_docs`, `contenido_docs`, `created_at`) VALUES
(2, 'Algebra Lineal', '<p>El &aacute;lgebra lineal permite construir procesos para la representaci&oacute;n, organizaci&oacute;n e interpretaci&oacute;n de la informaci&oacute;n de forma clara, precisa y sencilla a trav&eacute;s de la representaci&oacute;n de matrices y el planteamiento de sistemas de ecuaciones lineales.</p>\n<p>Este m&oacute;dulo se desarrolla en cuatro unidades, cada una compuesta por dos escenarios. La duraci&oacute;n de cada escenario es de una semana, apoyado por diferentes materiales: lectura fundamental, material complementario, material de apoyo, actividad de refuerzo&nbsp; y actividad evaluativa.</p>\n<h3 style=\"text-align: center;\"><span style=\"font-size: 18pt;\">Notas Importantes</span></h3>\n<ul>\n<li>Este m&oacute;dulo es de tipolog&iacute;a <strong>te&oacute;rico pr&aacute;ctico</strong>.</li>\n<li>En total son 4 tipolog&iacute;as: <span style=\"background-color: #2dc26b;\">Te&oacute;rico, Te&oacute;rico Pr&aacute;ctico, Proyecto y Ciencias B&aacute;sicas.</span></li>\n<li>Cada escenario deber&aacute; durar <span style=\"background-color: #f1c40f;\">1 semana</span>.</li>\n<li>M&oacute;dulo de Algebra Lineal desde el 8 de julio hasta el 1 de septiembre.</li>\n</ul>\n<h3 style=\"text-align: center;\"><span style=\"font-size: 18pt;\">Sistemas de Ecuaciones Lineales</span></h3>\n<p>Escenario 1: Matrices y los sistemas de ecuaciones. Formas de organizar la informaci&oacute;n.</p>\n<p>Escenario 2: Determinando lo desconocido.</p>\n<p>Con el objetivo de poder organizar la informaci&oacute;n de forma clara, es importante definir un proceso que nos permita encontrar las diferentes relaciones necesarias para la toma de decisiones de forma eficaz. Vamos a identificar los datos m&aacute;s relevantes, siendo aquellos principalmente cuantificables; como lo es, el n&uacute;mero de personas que viajar&aacute;n, el n&uacute;mero de d&iacute;as que durar&aacute; el viaje y todo lo relacionado a costos.</p>\n<p>Las relaciones se dar&iacute;an basadas en las variaciones, como el n&uacute;mero de personas que finalmente viajar&aacute;n.</p>\n<blockquote class=\"dx-blockquote-note\"><strong>Nota: </strong> Una matriz es un arreglo bidimensional (rectangular) de elementos de un conjunto, enmarcados dentro de un par&eacute;ntesis o corchete. Los elementos dispuestos de forma horizontal se denominan filas y los ubicados de forma vertical se denominan columnas. Si los elementos del arreglo pertenecen al conjunto de los n&uacute;meros reales, se dice que es una matriz real.</blockquote>', '2020-07-08 02:02:07'),
(3, 'Método Gauss - Sistema de ecuaciones Lineales', '<p>Para aplicar el m&eacute;todo Gauss se debe realizar primero que todo una reducci&oacute;n de matrices, siendo un proceso que podemos ejecutar con una <span class=\"badge\" style=\"background-color: rgb(0, 123, 255); color: rgb(255, 255, 255);\">suma de filas</span> o <span class=\"badge\" style=\"background-color: rgb(0, 123, 255); color: rgb(255, 255, 255);\">resta de filas</span>, donde se debe cumplir una condici&oacute;n importante y es la existencia del mismo n&uacute;mero en dos filas, ejemplo:</p>\n<p><strong><span style=\"font-family: arial, helvetica, sans-serif; color: #e74c3c; font-size: 12pt;\">Suma de filas</span></strong></p>\n<table style=\"border-collapse: collapse; width: 100%;\" border=\"1\">\n<tbody>\n<tr>\n<td style=\"width: 25%;\">-4</td>\n<td style=\"width: 25%;\">3</td>\n<td style=\"width: 25%;\">-7</td>\n<td style=\"width: 25%;\">1</td>\n</tr>\n<tr>\n<td style=\"width: 25%;\">4</td>\n<td style=\"width: 25%;\">2</td>\n<td style=\"width: 25%;\">-2</td>\n<td style=\"width: 25%;\">5</td>\n</tr>\n</tbody>\n</table>\n<p>Como podemos observar, se puede aplicar la reducci&oacute;n al realizar la operaci&oacute;n -4 + 4 = 0, donde la segunda fila completa se deber&aacute; sumar o restar con la primera para su resultado final.</p>\n<p><strong><span style=\"font-family: arial, helvetica, sans-serif; color: #e74c3c; font-size: 12pt;\">Resta de filas</span></strong></p>\n<p><span style=\"font-family: arial, helvetica, sans-serif; color: #000000; font-size: 12pt;\">Ejemplo de resta de filas:</span></p>\n<table style=\"border-collapse: collapse; width: 100%;\" border=\"1\">\n<tbody>\n<tr>\n<td style=\"width: 25%;\">4</td>\n<td style=\"width: 25%;\">3</td>\n<td style=\"width: 25%;\">-8</td>\n<td style=\"width: 25%;\">2</td>\n</tr>\n<tr>\n<td style=\"width: 25%;\">4</td>\n<td style=\"width: 25%;\">7</td>\n<td style=\"width: 25%;\">1</td>\n<td style=\"width: 25%;\">-1</td>\n</tr>\n</tbody>\n</table>\n<p>Como podemos observar</p>', '2020-07-18 15:34:19'),
(4, 'Método de eliminación de Gauss - Sistema de ecuaciones Lineales', '<p>Para aplicar el m&eacute;todo Gauss se debe realizar primero que todo una reducci&oacute;n de matrices a la forma escalonada reducida por filas, siendo un proceso que podemos ejecutar con una <span class=\"badge\" style=\"background-color: #007bff; color: #ffffff;\">suma de filas</span> o <span class=\"badge\" style=\"background-color: #007bff; color: #ffffff;\">resta de filas</span>, donde se debe cumplir una condici&oacute;n importante y es la existencia del mismo n&uacute;mero en dos filas, ejemplo:</p>\n<p><strong><span style=\"font-family: arial, helvetica, sans-serif; color: #e74c3c; font-size: 12pt;\">Suma de filas</span></strong></p>\n<table style=\"border-collapse: collapse; width: 100%;\" border=\"1\">\n<tbody>\n<tr>\n<td style=\"width: 25%;\">-4</td>\n<td style=\"width: 25%;\">3</td>\n<td style=\"width: 25%;\">-7</td>\n<td style=\"width: 25%;\">1</td>\n</tr>\n<tr>\n<td style=\"width: 25%;\">4</td>\n<td style=\"width: 25%;\">2</td>\n<td style=\"width: 25%;\">-2</td>\n<td style=\"width: 25%;\">5</td>\n</tr>\n</tbody>\n</table>\n<p>Como podemos observar, se puede aplicar la reducci&oacute;n al realizar la operaci&oacute;n -4 + 4 = 0, donde la segunda fila completa se deber&aacute; sumar o restar con la primera para su resultado final.</p>\n<p><strong><span style=\"font-family: arial, helvetica, sans-serif; color: #e74c3c; font-size: 12pt;\">Resta de filas</span></strong></p>\n<p><span style=\"font-family: arial, helvetica, sans-serif; color: #000000; font-size: 12pt;\">Nota: en la suma de filas, la primer fila se debe modificar por el resultado de la suma. En la resta, la segunda fila se debe reemplazar por el resultado de la resta.</span></p>\n<p><span style=\"font-family: arial, helvetica, sans-serif; color: #000000; font-size: 12pt;\">Ejemplo de resta de filas:</span></p>\n<table style=\"border-collapse: collapse; width: 100%;\" border=\"1\">\n<tbody>\n<tr>\n<td style=\"width: 25%;\">4</td>\n<td style=\"width: 25%;\">3</td>\n<td style=\"width: 25%;\">-8</td>\n<td style=\"width: 25%;\">2</td>\n</tr>\n<tr>\n<td style=\"width: 25%;\">4</td>\n<td style=\"width: 25%;\">7</td>\n<td style=\"width: 25%;\">1</td>\n<td style=\"width: 25%;\">-1</td>\n</tr>\n</tbody>\n</table>\n<p>Como podemos observar, tenemos en la misma fila 4 positivo, por lo que debemos invertir los signos de la primer fila: F2 - F1, para poder aplicar la resta y se har&iacute;a restando la fila 2 a la fila 1, donde en la fila 1 invertimos los signos, as&iacute;:</p>\n<table style=\"border-collapse: collapse; width: 100%; height: 42px;\" border=\"1\">\n<tbody>\n<tr style=\"height: 21px;\">\n<td style=\"width: 25%; height: 21px;\">4</td>\n<td style=\"width: 25%; height: 21px;\">7</td>\n<td style=\"width: 25%; height: 21px;\">1</td>\n<td style=\"width: 25%; height: 21px;\">-1</td>\n</tr>\n<tr style=\"height: 21px;\">\n<td style=\"width: 25%; height: 21px;\">-4</td>\n<td style=\"width: 25%; height: 21px;\">-3</td>\n<td style=\"width: 25%; height: 21px;\">8</td>\n<td style=\"width: 25%; height: 21px;\">-2</td>\n</tr>\n</tbody>\n</table>\n<p>por lo que el resultado ser&iacute;a:</p>\n<table style=\"border-collapse: collapse; width: 100%; height: 42px;\" border=\"1\">\n<tbody>\n<tr style=\"height: 21px;\">\n<td style=\"width: 25%; height: 21px;\">4</td>\n<td style=\"width: 25%; height: 21px;\">3</td>\n<td style=\"width: 25%; height: 21px;\">-8</td>\n<td style=\"width: 25%; height: 21px;\">2</td>\n</tr>\n<tr style=\"height: 21px;\">\n<td style=\"width: 25%; height: 21px;\">0</td>\n<td style=\"width: 25%; height: 21px;\">4</td>\n<td style=\"width: 25%; height: 21px;\">9</td>\n<td style=\"width: 25%; height: 21px;\">-3</td>\n</tr>\n</tbody>\n</table>\n<p><strong><span style=\"font-family: arial, helvetica, sans-serif; color: #e74c3c; font-size: 12pt;\">Diferentes operaciones:</span></strong></p>\n<p>Siempre que consideremos oportuno realizar la reducci&oacute;n de matrices a 0, debemos buscar la operaci&oacute;n m&aacute;s acorde para conseguirlo, por ejemplo:</p>\n<table style=\"border-collapse: collapse; width: 100%;\" border=\"1\">\n<tbody>\n<tr>\n<td style=\"width: 25%;\">2</td>\n<td style=\"width: 25%;\">3</td>\n<td style=\"width: 25%;\">-1</td>\n<td style=\"width: 25%;\">-4</td>\n</tr>\n<tr>\n<td style=\"width: 25%;\">-4</td>\n<td style=\"width: 25%;\">0</td>\n<td style=\"width: 25%;\">2</td>\n<td style=\"width: 25%;\">-1</td>\n</tr>\n</tbody>\n</table>\n<p>En este caso, si queremos realizar la resta de 4 a 0, podemos buscar la multiplicaci&oacute;n: F2 + 2F1</p>\n<table style=\"border-collapse: collapse; width: 100%;\" border=\"1\">\n<tbody>\n<tr>\n<td style=\"width: 25%;\">-4</td>\n<td style=\"width: 25%;\">0</td>\n<td style=\"width: 25%;\">2</td>\n<td style=\"width: 25%;\">-1</td>\n</tr>\n<tr>\n<td style=\"width: 25%;\">4</td>\n<td style=\"width: 25%;\">6</td>\n<td style=\"width: 25%;\">-2</td>\n<td style=\"width: 25%;\">-8</td>\n</tr>\n</tbody>\n</table>\n<p>Resultado:</p>\n<table style=\"border-collapse: collapse; width: 100%;\" border=\"1\">\n<tbody>\n<tr>\n<td style=\"width: 25%;\">2</td>\n<td style=\"width: 25%;\">3</td>\n<td style=\"width: 25%;\">-1</td>\n<td style=\"width: 25%;\">-4</td>\n</tr>\n<tr>\n<td style=\"width: 25%;\">0</td>\n<td style=\"width: 25%;\">6</td>\n<td style=\"width: 25%;\">0</td>\n<td style=\"width: 25%;\">-9</td>\n</tr>\n</tbody>\n</table>', '2020-07-18 15:43:30'),
(5, 'Notas Importantes Algebra Lineal', '<ol>\n<li>Las semanas inician los mi&eacute;rcoles y finalizan los martes.</li>\n<li>En la suma o resta de matrices, tener en cuenta la operaci&oacute;n de signos.</li>\n<li>Para resolver una ecuaci&oacute;n matricial, es igual a resolver una ecuaci&oacute;n, solo que con matrices.</li>\n<li>Propiedades de la suma de matrices: conmutativa&nbsp; A + B = B - A Propiedad asociativa (A + B) + C o A + (B + C)&nbsp; Modulativa A + 0 = A y 0 + A = A Inverso aditivo: la suma de A + (-A) = 0 o matriz nula.</li>\n<li>Producto escalar: multiplicar una matriz por un n&uacute;mero real no me altera la dimensi&oacute;n de la matriz. Propiedades adicionales del producto escalar: \"Distributiva respecto a suma de escalares\"&nbsp; y \"Distributiva respecto a suma de matrices\" 1A = A.</li>\n<li>Combinaci&oacute;n lineal: multiplicar las matrices por constantes y el resultado es la combinaci&oacute;n lineal.</li>\n<li>Matriz escalonada por filas: si hay una fila con solo ceros, debe estar al final o parte inferior de la matriz, se define el 1 cuando no es 0 antes de cualquier otra definici&oacute;n de n&uacute;mero y los 1 deben estar a la derecha a la fila anterior.</li>\n<li>Matriz escalonada reducida: si la final contiene 1 los elementos de esa columna deben ser 0.</li>\n<li>Toda matriz se puede reducir a una matriz escalonada reducida por filas o escalonada por filas.</li>\n<li>Operaciones elementales por filas: intercambio de filas, multiplicaci&oacute;n de filas, divisi&oacute;n de fila, suma o resta de filas o combinaci&oacute;n de las 3 operaciones anteriores.</li>\n<li>Un sistema de ecuaciones lineales est&aacute; compuesto por: los coeficientes, las inc&oacute;gnitas y los t&eacute;rminos independientes. En notaci&oacute;n AX = B</li>\n<li>Si B = 0 el sistema se denomina homog&eacute;neo.</li>\n<li>Un sistema de ecuaciones lineales es cuando se presentan n ecuaciones con n inc&oacute;gnitas.</li>\n<li>Un sistema de ecuaciones lineales puede tener solo una soluci&oacute;n (consistente), no tenerla o tener infinitas (inconsistente). Cuando en la soluci&oacute;n x = 0 se llama una soluci&oacute;n trivial.</li>\n</ol>', '2020-07-18 16:34:08');
INSERT INTO `sig_docs` (`id`, `nombre_docs`, `contenido_docs`, `created_at`) VALUES
(6, 'Método de eliminación Gauss', '<p>Para aplicar el m&eacute;todo Gauss Jordan, se debe realizar primero que todo una reducci&oacute;n de matrices a la forma escalonada reducida por filas, sin requerir sustituci&oacute;n hacia atr&aacute;s.</p>\n<p>Ejemplo:</p>\n<p>Encontrar una funci&oacute;n cuadr&aacute;tica que pase por los puntos P(-1, 4), Q(2, 1) y R(3, 4)</p>\n<p>Nota: una funci&oacute;n cuadr&aacute;tica es de la forma: y = ax&sup2; + bx + c siendo a b y c los coeficientes y x la inc&oacute;gnita.</p>\n<p>Cuando revisamos los puntos de un plano cartesiano, recordemos que el primer punto es x y el segundo es y.</p>\n<p>P =&nbsp; &nbsp; &nbsp;4 = a(-1)&sup2; + b(-1) + c</p>\n<p><span class=\"badge\" style=\"background-color: #007bff; color: #ffffff;\">P=&nbsp; &nbsp; &nbsp;4 = a - b + c</span></p>\n<p>Q=&nbsp; &nbsp; 1 = a(2)&sup2; + b(2) + c</p>\n<p><span class=\"badge\" style=\"background-color: #007bff; color: #ffffff;\">Q=&nbsp; &nbsp; 1 = 4a + 2b + c</span></p>\n<p>R=&nbsp; &nbsp; &nbsp;4 = a(3)&sup2; + b(3) + c</p>\n<p><span class=\"badge\" style=\"background-color: #007bff; color: #ffffff;\">R=&nbsp; &nbsp; &nbsp;4 = 9a + 3b + c</span></p>\n<p><span class=\"badge\" style=\"background-color: #2dc26b; color: #ffffff;\">Nota: tanto en Gauss como en Gauss Jordan, nos pide la matriz aumentada.</span></p>\n<p>En este caso la matriz aumentada ser&iacute;a:</p>\n<table style=\"border-collapse: collapse; width: 100%; height: 42px;\" border=\"1\">\n<tbody>\n<tr style=\"height: 21px;\">\n<td style=\"width: 25%; height: 21px;\"><span class=\"badge\" style=\"background-color: #f1c40f; color: #ffffff;\">1</span></td>\n<td style=\"width: 25%; height: 21px;\"><span class=\"badge\" style=\"background-color: #f1c40f; color: #ffffff;\">-1</span></td>\n<td style=\"width: 25%; height: 21px;\"><span class=\"badge\" style=\"background-color: #f1c40f; color: #ffffff;\">1</span></td>\n<td style=\"width: 25%; height: 21px;\"><span class=\"badge\" style=\"background-color: #e67e23; color: #ffffff;\">4</span></td>\n</tr>\n<tr style=\"height: 21px;\">\n<td style=\"width: 25%; height: 21px;\"><span class=\"badge\" style=\"background-color: #f1c40f; color: #ffffff;\">4</span></td>\n<td style=\"width: 25%; height: 21px;\"><span class=\"badge\" style=\"background-color: #f1c40f; color: #ffffff;\">2</span></td>\n<td style=\"width: 25%; height: 21px;\"><span class=\"badge\" style=\"background-color: #f1c40f; color: #ffffff;\">1</span></td>\n<td style=\"width: 25%; height: 21px;\"><span class=\"badge\" style=\"background-color: #e67e23; color: #ffffff;\">1</span></td>\n</tr>\n<tr>\n<td style=\"width: 25%;\"><span class=\"badge\" style=\"background-color: #f1c40f; color: #ffffff;\">9</span></td>\n<td style=\"width: 25%;\"><span class=\"badge\" style=\"background-color: #f1c40f; color: #ffffff;\">3</span></td>\n<td style=\"width: 25%;\"><span class=\"badge\" style=\"background-color: #f1c40f; color: #ffffff;\">1</span></td>\n<td style=\"width: 25%;\"><span class=\"badge\" style=\"background-color: #e67e23; color: #ffffff;\">4</span></td>\n</tr>\n</tbody>\n</table>\n<p style=\"text-align: center;\"><img src=\"data:image/png;base64,\" /></p>\n<p style=\"text-align: center;\">Operaciones elementales entre filas</p>\n<p style=\"text-align: justify;\">Al trabajar en orden, nos damos cuenta que para volver la matriz, en una matriz escalonada reducida, debemos cambiar el 4 y 9 de la primer columna por 0. Para este ejemplo, vamos a utilizar la multiplicaci&oacute;n con la fila 1 de la fila 2, ya que as&iacute;, podemos obtener la resta de 4 para encontrar el primer 0, operaci&oacute;n -4f1 + f2, asignando el resultado en la fila 2, obteniendo:</p>\n<table style=\"border-collapse: collapse; width: 100%; height: 63px;\" border=\"1\">\n<tbody>\n<tr style=\"height: 21px;\">\n<td style=\"width: 25%; height: 21px;\">1</td>\n<td style=\"width: 25%; height: 21px;\">-1</td>\n<td style=\"width: 25%; height: 21px;\">1</td>\n<td style=\"width: 25%; height: 21px;\">4</td>\n</tr>\n<tr style=\"height: 21px;\">\n<td style=\"width: 25%; height: 21px;\"><span class=\"badge\" style=\"background-color: #2dc26b; color: #ffffff;\">0</span></td>\n<td style=\"width: 25%; height: 21px;\"><span class=\"badge\" style=\"background-color: #2dc26b; color: #ffffff;\">6</span></td>\n<td style=\"width: 25%; height: 21px;\"><span class=\"badge\" style=\"background-color: #2dc26b; color: #ffffff;\">-3</span></td>\n<td style=\"width: 25%; height: 21px;\"><span class=\"badge\" style=\"background-color: #2dc26b; color: #ffffff;\">-15</span></td>\n</tr>\n<tr style=\"height: 21px;\">\n<td style=\"width: 25%; height: 21px;\">9</td>\n<td style=\"width: 25%; height: 21px;\">3</td>\n<td style=\"width: 25%; height: 21px;\">1</td>\n<td style=\"width: 25%; height: 21px;\">4</td>\n</tr>\n</tbody>\n</table>\n<p style=\"text-align: justify;\">&nbsp;Ahora para el 9 tenemos -9f1 + f3</p>\n<table style=\"border-collapse: collapse; width: 100%;\" border=\"1\">\n<tbody>\n<tr>\n<td style=\"width: 25%;\">1</td>\n<td style=\"width: 25%;\">-1</td>\n<td style=\"width: 25%;\">1</td>\n<td style=\"width: 25%;\">4</td>\n</tr>\n<tr>\n<td style=\"width: 25%;\">0</td>\n<td style=\"width: 25%;\">6</td>\n<td style=\"width: 25%;\">-3</td>\n<td style=\"width: 25%;\">-15</td>\n</tr>\n<tr>\n<td style=\"width: 25%;\"><span class=\"badge\" style=\"background-color: #2dc26b; color: #ffffff;\">0</span></td>\n<td style=\"width: 25%;\"><span class=\"badge\" style=\"background-color: #2dc26b; color: #ffffff;\">12</span></td>\n<td style=\"width: 25%;\"><span class=\"badge\" style=\"background-color: #2dc26b; color: #ffffff;\">-8</span></td>\n<td style=\"width: 25%;\"><span class=\"badge\" style=\"background-color: #2dc26b; color: #ffffff;\">-32</span></td>\n</tr>\n</tbody>\n</table>\n<p>Ya con esto, tenemos el primer 1 principal.</p>\n<p>Ahora, para cumplir con la matriz escalonada reducida, debemos buscar el segundo 1 principal de la columna 2. Para ello, podemos buscarlo a trav&eacute;s de la divisi&oacute;n f2/6:</p>\n<table style=\"border-collapse: collapse; width: 100%; height: 63px;\" border=\"1\">\n<tbody>\n<tr style=\"height: 21px;\">\n<td style=\"width: 25%; height: 21px;\">1</td>\n<td style=\"width: 25%; height: 21px;\">-1</td>\n<td style=\"width: 25%; height: 21px;\">1</td>\n<td style=\"width: 25%; height: 21px;\">4</td>\n</tr>\n<tr style=\"height: 21px;\">\n<td style=\"width: 25%; height: 21px;\"><span class=\"badge\" style=\"background-color: #2dc26b; color: #ffffff;\">0</span></td>\n<td style=\"width: 25%; height: 21px;\"><span class=\"badge\" style=\"background-color: #2dc26b; color: #ffffff;\">1</span></td>\n<td style=\"width: 25%; height: 21px;\"><span class=\"badge\" style=\"background-color: #2dc26b; color: #ffffff;\">-1/2</span></td>\n<td style=\"width: 25%; height: 21px;\"><span class=\"badge\" style=\"background-color: #2dc26b; color: #ffffff;\">-5/2</span></td>\n</tr>\n<tr style=\"height: 21px;\">\n<td style=\"width: 25%; height: 21px;\">0</td>\n<td style=\"width: 25%; height: 21px;\">12</td>\n<td style=\"width: 25%; height: 21px;\">-8</td>\n<td style=\"width: 25%; height: 21px;\">-32</td>\n</tr>\n</tbody>\n</table>\n<p>Nota: Cuando tenemos un 1 exactamente en la fila x columna superior, se debe aplicar la resta o suma dependiendo de los signos para la obtenci&oacute;n del cero de la fila inferior, como en este caso, procederemos para el 12, donde -12f2 + f3:</p>\n<table style=\"border-collapse: collapse; width: 100%;\" border=\"1\">\n<tbody>\n<tr>\n<td style=\"width: 25%;\">1</td>\n<td style=\"width: 25%;\">-1</td>\n<td style=\"width: 25%;\">1</td>\n<td style=\"width: 25%;\">4</td>\n</tr>\n<tr>\n<td style=\"width: 25%;\">0</td>\n<td style=\"width: 25%;\">1</td>\n<td style=\"width: 25%;\">-1/2</td>\n<td style=\"width: 25%;\">-5/2</td>\n</tr>\n<tr>\n<td style=\"width: 25%;\"><span class=\"badge\" style=\"background-color: #2dc26b; color: #ffffff;\">0</span></td>\n<td style=\"width: 25%;\"><span class=\"badge\" style=\"background-color: #2dc26b; color: #ffffff;\">0</span></td>\n<td style=\"width: 25%;\"><span class=\"badge\" style=\"background-color: #2dc26b; color: #ffffff;\">-2</span></td>\n<td style=\"width: 25%;\"><span class=\"badge\" style=\"background-color: #2dc26b; color: #ffffff;\">-2</span></td>\n</tr>\n</tbody>\n</table>\n<p>Ahora queremos buscar el 1 de la fila 3 columna 3; en este caso, procedemos con una divisi&oacute;n de f3/-2:</p>\n<table style=\"border-collapse: collapse; width: 100%; height: 61px;\" border=\"1\">\n<tbody>\n<tr style=\"height: 21px;\">\n<td style=\"width: 25%; height: 21px;\">1</td>\n<td style=\"width: 25%; height: 21px;\">-1</td>\n<td style=\"width: 25%; height: 21px;\">1</td>\n<td style=\"width: 25%; height: 21px;\">4</td>\n</tr>\n<tr style=\"height: 19px;\">\n<td style=\"width: 25%; height: 19px;\">0</td>\n<td style=\"width: 25%; height: 19px;\">1</td>\n<td style=\"width: 25%; height: 19px;\">-1/2</td>\n<td style=\"width: 25%; height: 19px;\">-5/2</td>\n</tr>\n<tr style=\"height: 21px;\">\n<td style=\"width: 25%; height: 21px;\"><span class=\"badge\" style=\"background-color: #2dc26b; color: #ffffff;\">0</span></td>\n<td style=\"width: 25%; height: 21px;\"><span class=\"badge\" style=\"background-color: #2dc26b; color: #ffffff;\">0</span></td>\n<td style=\"width: 25%; height: 21px;\"><span class=\"badge\" style=\"background-color: #2dc26b; color: #ffffff;\">1</span></td>\n<td style=\"width: 25%; height: 21px;\"><span class=\"badge\" style=\"background-color: #2dc26b; color: #ffffff;\">1</span></td>\n</tr>\n</tbody>\n</table>\n<p>En este punto, logramos implementar el m&eacute;todo de Gauss.</p>\n<p>Con este resultado, ya conocemos el valor de c = 1</p>\n<p>Por lo tanto, para obtener b, ser&iacute;a:</p>\n<p>b + (-c / 2) = -5 / 2</p>\n<p>b - 1 / 2 = -5 / 2</p>\n<p>b = -5 / 2 + 1 / 2</p>\n<p>b = -4 / 2</p>\n<p>b = -2</p>\n<p>Ahora, solo nos falta resolver a:</p>\n<p>a + (-b) + c = 4</p>\n<p>a + 2 + 1 = 4</p>\n<p>a + 3 = 4</p>\n<p>a = 4 - 3</p>\n<p>a = 1</p>', '2020-07-18 21:08:04');
INSERT INTO `sig_docs` (`id`, `nombre_docs`, `contenido_docs`, `created_at`) VALUES
(7, 'Resolviendo ecuaciones', '<p>Hay varios m&eacute;todos por los cuales podemos resolver ecuaciones. A continuaci&oacute;n, tenemos un ejemplo b&aacute;sico:</p>\n<p style=\"text-align: center;\"><strong>M&eacute;todo de Reducci&oacute;n</strong></p>\n<p>2s - 5t = 7</p>\n<p>-2s + 4t = -6</p>\n<p>Este ejemplo es bastante simple, ya que podemos proceder a cancelar 2s - 2s y sumar -5t + 4t = -t, luego 7 + (-6) = 1 y finalmente t = -1</p>\n<p>Por lo tanto:</p>\n<p>2s - 5(-1) = 7</p>\n<p>2s + 5 = 7</p>\n<p>s = 7 - 5 / 2</p>\n<p>s = 2 / 2</p>\n<p>s = 1</p>\n<p>Otro ejemplo del m&eacute;todo de reducci&oacute;n, ser&iacute;a el siguiente, teniendo 2 ecuaciones con 2 inc&oacute;gnitas:</p>\n<p>2x - 6y = 4</p>\n<p>3x + 2y = 17</p>\n<p>Nota: El m&eacute;todo de reducci&oacute;n, se recomienda, cuando una inc&oacute;gnita, presenta un valor positivo y uno negativo en las ecuaciones.</p>\n<p>El primer paso, ser&iacute;a la multiplicaci&oacute;n, para la reducci&oacute;n, por lo que procedemos a igualar -6y as&iacute;:</p>\n<p>3(3x + 2y) = 3(17)</p>\n<p>9x + 6y = 51</p>\n<p>2. Ahora, realizamos la suma de ecuaciones, quedando:</p>\n<p>(2x + 9x) (-6y + 6y) (4 + 51)</p>\n<p>11x&nbsp; &nbsp;= 55</p>\n<p>&nbsp;x = 55 / 11</p>\n<p>x = 5</p>\n<p>Por lo que ahora podemos proceder a despejar y:</p>\n<p>2(5) - 6y = 4</p>\n<p>10 - 6y = 4</p>\n<p>6y = 4 - 10</p>\n<p>y = -6 / 6</p>\n<p>y = 1</p>\n<p>&nbsp;</p>', '2020-07-19 01:39:53');
INSERT INTO `sig_docs` (`id`, `nombre_docs`, `contenido_docs`, `created_at`) VALUES
(8, 'Matriz Inversa', '<p>Una matriz inversa es una matriz cuadrada, sino es cuadrada no se puede realizar la matriz inversa.</p>\n<p>En la matriz inversa, se debe cumplir la propiedad conmutativa, es decir, AB = BA, dando como resultado la matriz identidad o id&eacute;ntica.</p>\n<p>Sabemos si se cumple la matriz inversa, cuando al multiplicar AB obtenemos:</p>\n<table style=\"border-collapse: collapse; width: 100%;\" border=\"1\">\n<tbody>\n<tr>\n<td style=\"width: 50%;\">1</td>\n<td style=\"width: 50%;\">0</td>\n</tr>\n<tr>\n<td style=\"width: 50%;\">0</td>\n<td style=\"width: 50%;\">1</td>\n</tr>\n</tbody>\n</table>\n<p>Ejemplo de multiplicaci&oacute;n AB:&nbsp;</p>\n<p><img src=\"data:image/png;base64,\" /></p>\n<p>Ahora, multiplicando BA, obtenemos, el mismo resultado.</p>\n<p>A continuaci&oacute;n, se presentan propiedades importantes de la matriz identidad:</p>\n<p><img src=\"data:image/png;base64,\" /></p>\n<ol>\n<li>No existen dos inversas diferentes para una matriz.</li>\n<li>Al obtener o multiplicar la inversa por su inversa, como resultado dar&aacute; la matriz inicial A.</li>\n<li>&nbsp;A la traspuesta de A, puedo sacar la matriz inversa (o) a la matriz inversa de A le puedo sacar la traspuesta, sin cambiar el resultado.</li>\n<li>Puedo obtener la inversa de AB, multiplicando AB o multiplicando la inversa de A y B.</li>\n<li>Cuando una matriz est&aacute; multiplicada por un escalar, la matriz inversa queda multiplicada por 1/a o uno sobre el escalar.</li>\n</ol>\n<p style=\"text-align: center;\"><strong>Encontrar la Matriz Inversa</strong></p>\n<p style=\"text-align: justify;\"><img src=\"data:image/png;base64,\" /></p>\n<p style=\"text-align: justify;\">Lo primero que debemos hacer es convertir en 0 f2c1 y f1c2.</p>\n<p style=\"text-align: justify;\">Para obtener el resultado, debe ser mediante las operaciones elementales, de la siguiente manera:</p>\n<ol>\n<li style=\"text-align: justify;\">Fila 1 dividido entre 2: f1 / 2</li>\n<li style=\"text-align: justify;\">Dos veces la fila 1 menos&nbsp;la fila 2: 2f1 - f2</li>\n<li style=\"text-align: justify;\">Dos veces la fila 1 menos la fila 3: 2f1 - f3</li>\n</ol>\n<p><img src=\"data:image/png;base64,\" /></p>\n<p>Ahora, en el orden de lo requerido, debemos obtener en la fila 2 el 1 positivo, por lo que haremos una multiplicaci&oacute;n de signos solo en la fila 2:</p>\n<p><img src=\"data:image/png;base64,\" /></p>\n<p>Nota: al reemplazar un valor, debemos ser cuidadosos de no afectar los otros resultados ya encontrados; cuando una fila tiene varios ceros, nos puede ser de utilidad, por lo que, para cambiar el 3 a 0 podemos apoyarnos en la fila 2 con la siguiente operaci&oacute;n elemental: f1 - 3f2</p>\n<p>Luego la suma de f2 + f3</p>\n<p style=\"text-align: justify;\">&nbsp;</p>', '2020-07-19 17:02:08');
INSERT INTO `sig_docs` (`id`, `nombre_docs`, `contenido_docs`, `created_at`) VALUES
(9, 'Matriz Inversa con determinantes', '<p>Para la matriz inversa con determinantes se deben realizar los siguientes procesos:</p>\n<ol>\n<li>Calcular la matriz de menores:</li>\n</ol>\n<p>se hace, omitiendo por n&uacute;mero su fila y su columna, escribiendo los n&uacute;meros de la matriz de menores restante.</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>', '2020-07-20 00:32:43'),
(10, 'Matriz Inversa con determinantes', '<p>Para la matriz inversa con determinantes se deben realizar los siguientes procesos, teniendo el siguiente ejemplo:</p>\n<p><img src=\"data:image/png;base64,\" /></p>\n<ol>\n<li>Calcular la matriz de menores:</li>\n</ol>\n<p>se hace, omitiendo por n&uacute;mero su fila y su columna, escribiendo los n&uacute;meros de la matriz de menores restante. As&iacute;:</p>\n<p><img src=\"data:image/png;base64,\" /></p>\n<p>&nbsp; &nbsp; &nbsp;2. Luego de cada matriz de menores generada, debemos realizar la multiplicaci&oacute;n cruzada y luego la resta, ejemplo para la primer matriz de menores:</p>\n<p><img src=\"data:image/png;base64,\" /></p>\n<p>se debe realizar la siguiente operaci&oacute;n (0 * 2) - (0 * 0)</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>', '2020-07-20 00:38:14');
INSERT INTO `sig_docs` (`id`, `nombre_docs`, `contenido_docs`, `created_at`) VALUES
(11, 'Matriz Inversa con determinantes', '<p>Para la matriz inversa con determinantes se deben realizar los siguientes procesos, teniendo el siguiente ejemplo:</p>\n<p><img src=\"data:image/png;base64,\" /></p>\n<ol>\n<li>Calcular la matriz de menores:</li>\n</ol>\n<p>se hace, omitiendo por n&uacute;mero su fila y su columna, escribiendo los n&uacute;meros de la matriz de menores restante. As&iacute;:</p>\n<p><img src=\"data:image/png;base64,\" /></p>\n<p>&nbsp; &nbsp; &nbsp;2. Luego de cada matriz de menores generada, debemos realizar la multiplicaci&oacute;n cruzada y luego la resta, ejemplo para la primer matriz de menores:</p>\n<p><img src=\"data:image/png;base64,\" /></p>\n<p>se debe realizar la siguiente operaci&oacute;n (0 * 2) - (0 * 0)</p>\n<p>Con esto, obtenemos el c&aacute;lculo de la matriz de menores, siendo la siguiente:</p>\n<p><img src=\"data:image/png;base64,\" /></p>\n<p>Luego, procedemos con el cambio de signos, seg&uacute;n la siguiente tabla, para la matriz de cofactores:</p>\n<p><img src=\"data:image/png;base64,\" /></p>\n<p>Con esto, obtenemos la matriz de cofactores:</p>\n<p><img src=\"data:image/png;base64,\" /></p>\n<p>Luego, realizamos la traspuesta de la matriz de cofactores, obteniendo la matriz de adjuntos finalmente:</p>\n<p><img src=\"data:image/png;base64,\" /></p>\n<p>Ahora, procedemos a hallar la determinante de la matriz original, esto, agregando las dos filas iniciales al final y luego, la multiplicaci&oacute;n de las diagonales, as&iacute;:</p>\n<p><img src=\"data:image/png;base64,\" width=\"150\" height=\"159\" /></p>\n<p><img src=\"data:image/png;base64,\" width=\"150\" height=\"153\" /> &nbsp;</p>\n<p>Ejemplo: (1 x 0 x 2)signo(0 x 0 x 1)signo(0 x 2 x 0) - (1 x 0 x 0)signo(0 x 0 x 1)signo(2 x 2 x 2)</p>\n<p>signo = seg&uacute;n el resultado de la multiplicaci&oacute;n.</p>\n<p>Resultado = -8</p>\n<p>Finalmente, el resultado se multiplica como -1/8 por la matriz adjunta.</p>\n<p><img src=\"data:image/png;base64,\" /></p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>', '2020-07-20 00:38:23');
INSERT INTO `sig_docs` (`id`, `nombre_docs`, `contenido_docs`, `created_at`) VALUES
(12, 'Modelo de Procesos Seleccionado', '<p>Partiendo de la premisa que cada modelo de proceso presenta mayores ventajas frente a un tipo de proyecto de software en particular, queriendo decir con esto que no se elige el mismo modelo cuando tenemos un proyecto peque&ntilde;o con todos los requerimientos bien definidos, que un proyecto grande con escasa definici&oacute;n de requerimientos. Es de gran importancia conocer y analizar todas las caracter&iacute;sticas que presenta cada modelo, donde buscaremos elegir la decisi&oacute;n m&aacute;s adecuada frente a los requerimientos del cliente y teniendo en cuenta factores muy importantes como el tiempo, disminuci&oacute;n de riesgos, calidad, soporte, dominio sobre el tema, equipo de trabajo, entre otros.</p>\n<p>Para dar inicio, presentaremos un escenario hipot&eacute;tico donde el cliente que requiere el desarrollo, ha informado los requerimientos aproximadamente en un 80% con claridad, donde en las reuniones establecidas se ha llegado a mutuo acuerdo de no realizar cambios significativos que puedan presentar retrocesos o posibles fallos futuros. De requerirse cambios, estos deben ser b&aacute;sicos o nivel medio, asociados a aspectos de dise&ntilde;o o mejoras en el funcionamiento, m&aacute;s no estructuras previamente definidas a nivel de base de datos por ejemplo. Adicional, el cliente informa disposici&oacute;n frente a posibles reuniones para visualizar avances, por lo que muestra inter&eacute;s en conocer avances parciales, pero resaltando prioridad en el resultado final.</p>\n<p>Seg&uacute;n lo enunciado, mencionaremos las ventajas y desventajas que presentan los modelos definidos en el escenario 2, partiendo de la relaci&oacute;n que tiene cada uno de estos con el proyecto definido por el equipo, siendo un software de historia cl&iacute;nica.</p>\n<p style=\"text-align: center;\"><strong>Modelo en Cascada</strong></p>\n<p>Aunque este modelo se puede ajustar a nuestro proyecto, ya que presenta caracter&iacute;sticas hasta cierto punto similares al escenario planteado, aclarando con esto que conocemos las ventajas que nos puede presentar para el caso que contamos con gran parte de requerimientos, claridad con el cliente para el tema de cambios y proyecto de complejidad media; consideramos que es poco flexible, frente a la ejecuci&oacute;n de cada etapa, donde se debe cumplir de forma estricta cada una en su totalidad para poder continuar con la siguiente, lo cual puede ser un gran riesgo frente a temas de organizaci&oacute;n en el equipo y toma de decisiones a nivel interno, conllevando posiblemente a p&eacute;rdidas significativas de tiempo. Adicional que el cliente est&aacute; interesado en ver avances.</p>\n<p style=\"text-align: center;\"><span class=\"badge\" style=\"background-color: #007bff; color: #ffffff;\">Modelo de Procesos Incremental</span></p>\n<p style=\"text-align: justify;\">Elegimos este modelo, que aunque no cumple a cabalidad con las especificaciones planteadas, es el que m&aacute;s se ajusta por las siguientes condiciones:</p>\n<ol>\n<li style=\"text-align: justify;\">No se encuentran definidos en su totalidad los requerimientos.</li>\n<li style=\"text-align: justify;\">El cliente presenta inter&eacute;s en ver avances.</li>\n<li style=\"text-align: justify;\">Nuestro proyecto, se puede ver de forma modular y no transaccional.</li>\n<li style=\"text-align: justify;\">Se pueden presentar cambios.</li>\n<li style=\"text-align: justify;\">Presenta flexibilidad en el manejo de las etapas.</li>\n</ol>\n<p>Reconocemos las siguientes desventajas:</p>\n<ol>\n<li>Complejidad en estimaci&oacute;n.</li>\n<li>Complejidad en gesti&oacute;n.</li>\n<li>Reducci&oacute;n en productividad por necesidad de comunicaci&oacute;n constante.</li>\n</ol>\n<p>No obstante, consideramos que estas desventajas pueden ser solucionadas, presentando una comunicaci&oacute;n asertiva con el cliente, siendo proactivos en la comprensi&oacute;n de las necesidades del cliente y el resultado final que este espera.</p>\n<p style=\"text-align: center;\"><strong>Modelo de procesos por prototipos</strong></p>\n<p style=\"text-align: justify;\">Este modelo, presenta caracter&iacute;sticas que inicialmente pueden parecer atractivas, pero consideramos que tiene m&aacute;s desventajas que ventajas sobre nuestro proyecto siendo las siguientes:</p>\n<ol>\n<li style=\"text-align: justify;\">El cliente no requiere prototipos no funcionales o parcialmente funcionales.</li>\n<li style=\"text-align: justify;\">Aunque puede mejorar la comunicaci&oacute;n la entrega de prototipos, aumenta nuestra incertidumbre frente al uso adecuado de tiempos y productividad.</li>\n<li style=\"text-align: justify;\">Nos preocupa las falsas expectativas que se puedan presentar en el cliente, al ver el prototipo pero no poder operar las funcionalidades a desarrollar en le software.</li>\n</ol>\n<p style=\"text-align: center;\"><strong>Modelo de procesos en espiral</strong></p>\n<p style=\"text-align: justify;\">Aunque este modelo presenta tambi&eacute;n un avance en las etapas considerable, mencionamos a continuaci&oacute;n la desventaja principal por la cual no fue seleccionado:</p>\n<p style=\"text-align: justify;\">1. La comunicaci&oacute;n y disposici&oacute;n de recursos constante, puede implicar enormes retos, que finalmente se relacionan con el desgaste del equipo o un alto riesgo de entrega de proyecto a satisfacci&oacute;n.</p>', '2020-07-26 04:48:06'),
(13, 'SCRUM', '<p>Su enfoque inicial es para proyectos de software, sin embargo, puede ser adaptado de manera f&aacute;cil a cualquier contexto o &aacute;rea de conocimiento.<br />Entre sus principales caracter&iacute;sticas est&aacute; que es muy f&aacute;cil de entender, aunque se puede volver complejo y dif&iacute;cil de implementar sino se siguen bien sus reglas.</p>\n<p>Roles: b&aacute;sicamente Scrum se compone de 3 roles principales.</p>\n<h3 style=\"text-align: center;\"><span class=\"badge\" style=\"background-color: #007bff; color: #ffffff;\">Product Owner </span></h3>\n<p><br />O due&ntilde;o del producto, es la persona que est&aacute; en constante comunicaci&oacute;n con el cliente, la cual debe transmitir de manera clara y precisa, las necesidades que el cliente tiene, al Team Development y organizaci&oacute;n de la informaci&oacute;n, de la mano con el Scrum Master.<br />Podemos comparar esta persona, con el ingeniero de requisitos que se va a encargar de establecer los requerimientos, entendiendo lo que el cliente necesita y finalmente permita la construcci&oacute;n del producto por los involucrados.</p>\n<p style=\"text-align: center;\"><span class=\"badge\" style=\"background-color: #007bff; color: #ffffff;\">SCRUM Master</span></p>\n<p>En resumen, es quien se encarga de revisar las actividades generales, ejercidas por el Product Owner y el Team Development. Este debe comprender como interactuar con los participantes, de forma asertiva.<br />El SCRUM Master, debe ser un profesional &iacute;ntegro, contando con la formaci&oacute;n y experiencia suficiente, actuando con liderazgo frente a todo el equipo.<br />Otras caracter&iacute;sticas con las cuales debe contar este rol, es una gran capacidad de comunicaci&oacute;n, con empat&iacute;a y con la capacidad de crear un ambiente positivo para el &eacute;xito de las reuniones.<br />Es importante tener en cuenta, que este rol no es el encargado de dar &oacute;rdenes ni opinar frente al deber ser de las cosas. Su objetivo principal es brindar apoyo y gu&iacute;a frente a las necesidades presentes por el equipo.</p>\n<p style=\"text-align: center;\"><span class=\"badge\" style=\"background-color: #007bff; color: #ffffff;\">Team Development</span></p>\n<p>Son las personas cualificadas, encargadas principalmente de construir el producto o necesidad que presenta el cliente.<br />Una de sus caracter&iacute;sticas fundamentales, es que cuenta con el conocimiento t&eacute;cnico para intervenir en los diferentes procesos del desarrollo, como donde pueden actuar como tester, analistas o las funciones a implementar dentro del equipo.</p>\n<p style=\"text-align: center;\"><span class=\"badge\" style=\"background-color: #f1c40f; color: #ffffff;\"><strong>Ciclo de Vida de</strong> <strong>Scrum</strong></span></p>\n<p><br />Inicialmente se debe definir el Backlog el cual contiene todas las tareas con sus respectivos elementos o PBI (Product Backlog Item) a tener en cuenta, especificando las funcionalidades o requerimientos del cliente, lo cual tambi&eacute;n conocemos como el Product Backlog o pila de producto</p>\n<p>Una frase de Ron Jeffries que llama mucho la atenci&oacute;n es la siguiente: \"If we have a fully defined backlog, we no longer have a true Agile Product Development situation\". La frase nos dice que si nosotros tenemos 100% definidos los requerimientos por el cliente, asegurando que est&aacute;n estructurados y no se alerte por el cliente o exista la posibilidad de nuevas solicitudes o inseguridad en los establecidos, entonces no tenemos realmente una situaci&oacute;n de desarrollo de producto &aacute;gil, sino un desarrollo que deber&iacute;a ser trabajado bajo los m&eacute;todos o modelos tradicionales, donde podemos desde un inicio, realizar la planeaci&oacute;n completa. En el desarrollo de un producto &aacute;gil, la planeaci&oacute;n se va implementando conforme avanzamos y aprendemos.<br />Bajo una metodolog&iacute;a &aacute;gil, se debe manejar con creatividad y no dar todo demasiado detallado porque al hacerlo as&iacute;, no se van a generar ideas nuevas en el equipo, no se van a presentar aportes al Product Backlog. Por ende, debe presentarse una comunicaci&oacute;n constante entre el Product Owner y el Team Development, en la construcci&oacute;n del Product Backlog, llegando a acuerdos.</p>\n<p><span class=\"badge\" style=\"background-color: #2dc26b; color: #ffffff;\">T&eacute;rminos:</span><br /><span class=\"badge\" style=\"background-color: #169179; color: #ffffff;\">Backlog:</span> podemos considerarlo como una lista o artefacto, el cual debe estar organizado frente a los items o PBI (Product Backlog Item) que se van definiendo, asociado a todas las tareas que se encuentran pendientes por ejecuci&oacute;n. Por ende, podemos interpretar que el Product Backlog contiene diferentes especificaciones de gran valor, ya que en este, puede haber necesidades, requerimientos, historias de usuario, casos de uso, defectos, correcciones entre muchas m&aacute;s cosas.</p>\n<p><br /><span class=\"badge\" style=\"background-color: #169179; color: #ffffff;\">El Product Backlog</span> est&aacute; principalmente ordenado por valor de negocio, queriendo decir, que los elementos m&aacute;s importantes definidos, deben estar organizado de arriba (mayor valor al cliente o usuario final) a abajo (menor valor).<br />Es muy importante tener en cuenta que lo que tiene m&aacute;s valor, se deber&aacute; revisar de manera m&aacute;s minuciosa, m&aacute;s a detalle.<br />Otra indicaci&oacute;n que puede tener el Backlog son los releases o pasos a producci&oacute;n, organizando las tareas por cada paso a producci&oacute;n y de esta manera podamos tener mayor comprensi&oacute;n de cada avance que se va ense&ntilde;ando al cliente.<br />La metodolog&iacute;a SCRUM tiene otra caracter&iacute;stica interesante y es el poder definir nuevos requerimientos o PBI (Backlog emergente - Posibilidad de agregar cosas nuevas), lo cual se conoce como adaptaci&oacute;n al cambio, seg&uacute;n las necesidades y las nuevas solicitudes impartidas por el cliente.</p>\n<p><span class=\"badge\" style=\"background-color: #169179; color: #ffffff;\">Requerimientos no funcionales:</span></p>\n<p>Definen como debe ser el sistema, describiendo todos los factores que debemos tener en cuenta, para el correcto funcionamiento de los requerimientos funcionales, principalmente asociados con la calidad, como el rendimiento, escalabilidad, viabilidad, disponibilidad, mantenimiento, seguridad, gesti&oacute;n de Base de datos, entre otros.</p>\n<p>Por ejemplo, hablamos de requerimientos no funcionales, cuando describimos cual lenguaje de programaci&oacute;n vamos a utilizar para el desarrollo, elecci&oacute;n del procesador, memoria RAM, especificaciones de interfaz gr&aacute;fica (usabilidad).</p>\n<p>Otro ejemplo: la interfaz gr&aacute;fica falicita su f&aacute;cil comprensi&oacute;n y optimizaci&oacute;n de cach&eacute; para mayor rendimiento y velocidad de procesamiento.</p>\n<p><span class=\"badge\" style=\"background-color: #169179; color: #ffffff;\">Requerimientos:</span> al momento de definir estos, es de gran importancia, revisar la necesidad del cliente y stakeholders. Revisar la situaci&oacute;n actual del sistema, organizaci&oacute;n, manejo de versiones</p>\n<p>Product Backlog y Sprint Backlog.</p>\n<p>Valores a tener en cuenta frente a la metodolog&iacute;a Scrum:</p>\n<p>1. Individuos y sus interacciones sobre procesos y herramientas<br />2. Software funcionando sobre documentaci&oacute;n extensiva<br />3. Colaboraci&oacute;n con el cliente sobre negociaci&oacute;n contractual<br />4. Responder a los cambios sobre seguir el plan</p>', '2020-08-01 01:45:38'),
(14, 'Actividades a desarrollar - Equipo', '<p>Catalina: SCRUM Master<br />Andrea: Product Owner&nbsp;<br />Team Development: Robinson Pulgarin Torres, Alexander</p>\n<p><span class=\"badge\" style=\"background-color: rgb(0, 123, 255); color: rgb(255, 255, 255);\">Importante:&nbsp;</span></p>\n<p><span class=\"badge\" style=\"background-color: #E03E2D; color: rgb(255, 255, 255);\">Que se entreguen los requerimientos antes de las 4pm del domingo, desarrollado por el Team Development.</span></p>\n<p><span class=\"badge\" style=\"background-color: #E03E2D; color: rgb(255, 255, 255);\">Realizar los requerimientos basado en lo expresado en el documento de \"Actividad Grupal\", considerando el proyecto de tama&ntilde;o mediano. Tratemos de ce&ntilde;irnos a las especificaciones dadas.</span></p>\n<p>&iquest;Qu&eacute; actividades van a desarrollar para el ejecutar el proyecto?<br />El product Backlog el cual trabajar&aacute; Alexander y Camilo - Apoyo de ser necesario Robinson</p>\n<p>Importante: desarrollar introducci&oacute;n.</p>\n<p>Robinson.</p>\n<p>&iquest;Qu&eacute; roles van ejecutar y qui&eacute;n lo har&aacute;?<br />Robinson&nbsp;</p>\n<p>&iquest;Cu&aacute;ndo van a desarrollar esas actividades?<br />Pendiente</p>\n<p>1. Identificaci&oacute;n de los requerimientos de su producto diferenciando los requerimientos funcionales y no funcionales.<br />Requerimientos funcionales: Alexander y Camilo<br />Requerimientos no funcionales: Robinson</p>\n<p>2. Especificaci&oacute;n de los casos de uso correspondiente a los requerimientos funcionales identificados en el punto anterior.<br />Catalina</p>\n<p>3. Especificaci&oacute;n adicional de los requerimientos no funcionales de su aplicaci&oacute;n.<br />Robinson</p>\n<p>4. Los diagramas de clases que corresponden al dise&ntilde;o detallado que satisface los requerimientos identificados.<br />Andrea</p>', '2020-08-01 02:54:40');

